(448, '', 'aha!-Reisen / Peter Gartz', 'info@aha-reisen.de', '+49 - 177 - 6629567', '26 + 1 Personen', '13.05.2015', '13 uur', '', '2015-05-03 11:13:41', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=994', 'Sehr geehrtes Colvenier-Team,\r\nam 13.05.15 werde ich mit einer Gruppe (deutsch-trkischer Kulturkreis) zu Besichtigungen in Antwerpen sein. Gerne wrde ich gegen 13:00 Uhr ein kleines Mittagessen einnehmen (kleine Vorspeise, kleines Hauptmen und kleines Dessert). Zuletzt hatte ich dies immer mit einem Restaurant Neuze-Neuze praktiziert, doch sie scheinen geschlossen zu sein. Knnten Sie mir bitte ein paar Vorschlge unterbreiten, so wrde ich mich schnell entscheiden falls Sie noch Pltze frei haben. Das kleine Men sollte um die  30,00 pro Pers. betragen und werden von mir bezahlt, die Getrnke zahlen die Gste selber. Vielleicht knnen wir auch telefonieren, das knnte ich auch in niederlndisch. ber eine Reaktion wrde ich mich sehr freuen....\r\nmit freundlichen Grssen\r\naha!-Reisen / Peter Gartz'),
