(844, 'Kristof', 'Brosens', 'kristof@deheerlyckheyt.be', '0468195414', '6', '16/11/2015', '18 uur 30', '', '2015-10-21 12:54:26', 'http://www.colvenier.be/reserveer.htm', 'Beste Patrick,\r\nwij komen die avond met de limousine tot bij jullie. Het is namelijk mijn vader zijn verjaardag en pensioenetentje.\r\nWe kijken er weer naar uit!\r\n\r\nVriendelijke groeten,\r\n\r\nKristof Brosens\r\nRestaurant De Heerlyckheyt\r\n'),
(845, '', 'De Heyn Thierry', 'rita.heremans@gmail.com', '0475362309', '6', 'zaterdag 14 november 2015', '19 uur', '', '2015-10-21 13:30:12', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=1482', '1 persoon is 8 maanden  zwanger'),
(846, '', 'Philip Portael', 'Philip@vejavino.be', '0499673500', '3', '29 oktober', '19 uur', '', '2015-10-21 13:43:08', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=1484', 'Verjaardag moeder (81)'),
(847, '', 'Rudi Illegems (voor de Firma Kuehne + Nagel N.V.)', 'rudi.illegems@kuehne-nagel.com', '0496606518', '10-12', 'donderdag 26 november 2015', '18 uur', '', '2015-10-21 13:43:51', 'http://www.colvenier.be/menu.htm', 'Beste,\r\nIk werk 25 jaar bij de firma en mag met een aantal mensen gaan uiteten.\r\nMen budget is op 60 eur/ persoon bepaald, maar kan zijn dat het wat meer mag zijn.\r\nNu zijn we al eens eerder bij jullie blijven eten met de formule aperitief in de kelder , dan een bepaald gangenmenu met drank en tot slot dan koffie...Is het mogelijk om een all in formule af te spreken per x-gangenmenu. Keuken mag voor mij ook minder de klassieke kant op indien dit mogelijk is en aub in de gangen geen kaas voorzien. Voor de rest sta ik voor alles open.\r\nLaat me weten of deze datum en uur past en wat jullie zouden voorstellen.\r\nDit is dus nog geen reservatie maar vraag voor info.\r\nAlvast bedankt,\r\n\r\nMvgr\r\nRudi Illegems'),
(848, '', 'Kris Janssens', 'krisjanssens@advocaat.be', '0473382198', '8', '31 oktober 2015', '19 uur 30', '', '2015-10-21 15:02:19', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=1485', 'n persoon dient glutenvrij te eten; vormt dit een probleem?'),
