(918, '', 'Annelies Lightband', 'annelies.lightband@gmail.com', '0498/532484', '8', '25/11/2015', '18 uur 30', '', '2015-11-03 12:36:53', 'http://www.colvenier.be/menu.htm?utm_source=colvenier&utm_medium=email&utm_campaign=0515', 'Graag inclusief aperitief in de kelder. Is er mogelijkheid tot aangepaste wijnen, en zo ja, wat is de meerprijs hiervan aub? \r\nDank bij voorbaat'),
(919, '', 'Birgit Walraet', 'birgit@walraet.org', '0486522803', '20', 'zaterdag 14/11/2015', '19 uur', '', '2015-11-03 15:59:19', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=1563', 'Goede middag,\r\n\r\nIk ben last minute nog bezig met het samenstellen van een programma voor een weekendbezoek aan Antwerpen voor Mediwok, de huisartsenkring Wezembeek-Oppem/Kraainem, voor het weekend van 13 tot en met 15 november e.k. Het gaat om een groep van 20 personen.\r\n\r\nZij wensen zaterdagavond te dineren in een goed restaurant en ik dacht daarvoor aan Huis de Colvenier.\r\n\r\nIs dat voor jullie nog mogelijk?\r\nIndien ja, wat is het menu dat jullie dan graag willen voorstellen (met aangepaste wijnen)?\r\n\r\nIs het eventueel ook mogelijk om voor het eten, bij de apero, een presentatie te doen van de sponsor van het weekend? Als de artsen een beetje apart kunnen zitten, hoeft het misschien niet in een apart zaaltje (al zou dat wel fijn zijn).\r\n\r\nIk veronderstel dat het ook geen probleem is om ter plaatse de factuur te voldoen met visa, of mag ze achteraf betaald worden?\r\nDe factuur mag op naam van Mediwok, p/a Mechelsesteenweg 79, 1970 Wezembeek-Oppem.\r\n\r\nHeel erg bedankt!\r\n\r\nMet vriendelijke groeten,\r\n\r\nBirgit\r\n\r\n---\r\nBirgit Walraet\r\nFreelance Event Manager\r\n\r\nSint-Bernardsesteenweg 260, 2020 Antwerpen, Belgium\r\nT: +32 (0)486 52 28 03\r\n'),
(920, '', 'Wuyts Nathalie', 'nathaliewuyts@live.be', '0475572521', '4', '05/11/2015', '19 uur 30', '', '2015-11-03 16:29:01', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=1564', 'Wij zouden tegen 18u30 - 19u willen aperitieven in jullie mooie wijnkelder.\r\nKan u mij een bevestiging sturen aub.\r\nAlvast bedankt en tot donderdag'),
(921, 'harry', 'engels', 'harry.engels@telenet.be', '0473669082', '4', '20.11.2015', '19 uur', '', '2015-11-03 20:05:28', 'http://www.colvenier.be/reserveer.htm', 'Dag Patrick,\r\n\r\nMimi heeft vandaag gereserveerd voor 20.11. Graag zouden we in het oude gedeelte van je restaurant een tafel hebben. Groetjes Harry'),
