(1639, 'Gerard', 'van Veghel', 'algemeen@drukkerijprimair.nl', '+31 (0073 5225913', '2', '20 juli', '12 uur', '', '2016-07-13 23:13:34', 'http://www.colvenier.be/reserveer.htm', 'Zoals reeds per telefoon besproken\r\ngraag het volgende reserveren voor 20 juli\r\nA: 1 suite\r\nVoor Diner\r\nA:in wijnkelder aperitief met 2 x 6 oesters. Mogen ook 2 verschillende zijn \r\nB: 5 gangen diner\r\nC: De gang kaas graag vervangen door een leuk tussengerecht.\r\nD: Voor het hoofdgerecht graag als extra een spoon( verfrissing)\r\nE: Mijn vrouw houd van de volgende ingredinten: gebakken ganzenlever, kreeft, zeetong of tarbot. Indien mogelijk geen gekweekte vis.\r\nVlees, laat ik aan u over.\r\nF: Graag bij elk gerecht een bijpassende wijn. Liever een keer bijvullen als te volle glazen.\r\nIndien mogelijk een rond tafeltje echter niet afgezonderd. En de gerechten graag niet te groot. \r\nMijn vrouw heeft een allergie voor Paprika wilt u hier rekening mee houden.\r\nWij houden van een ontspannen en gezellige sfeer maar vinden ook exclusiviteit wel belangrijk.\r\n\r\nAlgemeen:\r\nWij zullen ongeveer om 11.00 bij jullie zijn, gaan dan even naar de suite en dan Antwerpen in. Heeft u hiervoor nog een leuke suggestie laat het even weten.\r\n\r\n( dit is ter ere van ons 40 jarig huwelijk, zou u mijn een redelijk goede indicatie kunnen geven van de totale prijs, daar mijn kinderen er op staan om 50% te betalen.)\r\nMocht u nog iets willen weten hoor ik het graag.\r\n\r\ngr\r\nGerard van Veghel\r\n'),
