(41, 'Linda Meekels - Lameir', 'linda.lameir@edc-wines.be', '0497103067', 'Geachte Heer,\r\nBetreft : reservatie 13-12-2014 8 personen op naam van Meekels.\r\n\r\nZoals gisteren telefonisch medegedeeld kan onze dochter, die in het buitenland werkt, op 13 december niet aanwezig zijn.  Een andere datum vastleggen lijkt niet zo eenvoudig.  We hebben daarom besloten om alles te annuleren en we proberen begin volgend jaar een nieuwe datum vast te leggen.\r\n\r\nMet vriendelijk groeten,\r\n\r\nLinda LAMEIR', '2014-11-21 07:20:15', 'http://www.colvenier.be/reserveer.htm'),
