(43, 'STEFAN AUF DER MAUR', 'STEFAN.AUFDMAUR@GMAIL.COM', '0471 25  81 13', 'MIJN MAN VERJAARD OP 25.12. EN IK WOU EEN SPECIAAL RESTAURANT VINDEN. UW LOCAAL SPREEKT ME AAN MAAR IK VIND GEEN MENU VOOR KERST. IS ER IETS SPECIAALS?', '2014-11-24 19:50:11', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=204'),
