(45, 'Rita Claes', 'rita_claes@elenet.be', '0498408598   of', 'In januari reserveerde ik voor 8 personen op zaterdag 6 december 2014 ter gelegenheid van de 60ste verjaardag van mijn man. Ik hoop dat die reservatie mee opgenomen is in jullie planning. Moeten we vooraf doorgeven welk menu we kiezen of kunnen we dat doen bij aankomst? Zou het een probleem zijn als er een extra persoon mee aanschuift aan de tafel? De mama van mijn man is 90 en heeft nog niet beslist of ze meegaat. Vriendelijke groeten!', '2014-11-25 09:49:10', 'http://www.colvenier.be/reserveer.htm'),
(46, 'Jeannine Van den Bempt', 'jeannine.vandenbempt@exxonmobil.com', '0478265693', 'Beste chef, nav ons aangenaam gesprekje deze ochtend, graag dus een menu all in prijs 72  max betaling American Express. Ook graag rondleiding in de wijnkelder; Had graag het restaurant bezocht om de mogelijkheden van zitplaats te bekijken', '2014-11-26 13:10:59', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=219'),
(47, 'Eyckmans', 'eyckmans.debock@skynet.be', '0486878006', 'graag het menu van Oudejaar!', '2014-11-26 19:27:56', 'http://www.colvenier.be/reserveer.htm'),
(48, 'steve de roos', 'steve_de_roos@hotmail.com', '0485637828', 'Beste,\r\n\r\nIk zou met mijn vriendin willen komen eten maar zij is vegetarisch, hebt u een aangepaste menu voor haar?\r\n\r\nEn is er nog plaats op 29/12 of 30/12 rond 20.30?\r\n\r\nMet vriendelijke groeten,\r\n\r\nSteve', '2014-11-27 18:53:41', 'http://www.colvenier.be/reserveer.htm'),
(49, 'Bart Smits', 'bartzzz_smits@hotmail.com', '0651613573', 'Beste,\r\nZijn jullie op oudejaarsavond geopend en zo ja, is dit dan ook tot middernacht? \r\nIk zou dan graag voor 2 personen willen reserveren, mits dit nog mogelijk is. Wij zijn beide veganistisch, hogelijk is dat mogelijk. \r\n\r\nIk hoor graag van u. \r\nMet vriendelijke groet, \r\nBart Smits', '2014-11-28 11:31:51', 'http://www.colvenier.be/reserveer.htm'),
(50, 'Stefan Bastiaenssens', 'stefan.bastiaenssens@ondernemersschool.nl', '0474506287', 'Patrick,\r\nIk ben tijdje terug bij jou geweest, samen met Benjamin Ruyters. Wij zouden voor het eindejaar graag willen boeken met 32 mensen. Dit op donderdag 18 december. Om 16h30 apero in de kelder, dan een uurtje vergaderen, en om 18h aan tafel. Budget 60 euro p.p. Lukt dat ? Kan je me hierover bellen aub?\r\nThx,\r\nStefan Bastiaenssens', '2014-11-28 16:42:41', 'http://www.colvenier.be/reserveer.htm'),
(51, 'Medical Essentials ', 'hilde@m-e.be', '015/76 12 25', 'Geachte heer\r\nWij hebben met de firma een tafel besproken op zaterdag 20 december om 19 uur. Ron Vanstraelen heeft dit geboekt. Wij zullen met 16 personen aanwezig zijn. Welke betaalmogelijkheden zijn er?\r\nMvg\r\n\r\nHilde Van Dyck\r\nMedical Essentials BVBA\r\nIndustriepark B 24/1\r\n2220 Heist-op-den-Berg', '2014-12-02 14:13:37', 'http://www.colvenier.be/reserveer.htm'),
(52, 'Marieke', 'mmoerman@environcorp.com', '055612155', 'Beste\r\nik ben op zoek naar een nieuwjaarslunch voor 10 personen op woensdag 14 januari 2015.\r\nKan u mij de totale prijs en het menu doorgeven voor een 4-gangen menu inclusief wijnen en koffie?\r\n\r\nalvast bedankt\r\nMarieke\r\n\r\nEnviron Belgium\r\nMeersbloem 46\r\n9700 Oudenaarde', '2014-12-03 09:34:23', 'http://www.colvenier.be/reserveer.htm'),
(53, 'jeannine verbelen reyntjens', 'jeannine2312@hotmail.com', '0472712932', 'Graag had ik mijn kinderen getrakteerd in een klasse restaurant op23/12/2014 voor mijn verjaardag Kunt u een prijs maken alles inbegrepen voor 14 personnen,is dit mogelijk op deze drukken periode .Wij zijn reeds 3 keer bij u geweest ,het was altijd prima,maar in familie is het anders dan met zaken mensen .Beste dank voor een spoedig antwoord. \r\nJeannine Verbelen Reyntjens', '2014-12-03 11:40:29', 'http://www.colvenier.be/reserveer.htm'),
(54, 'Dominique Gorremans', 'dominique.gorremans@telenet.be', '0490652529', 'Tot hoe laat bent u open op 31/12 voor het nieuwjaarsmenu?', '2014-12-03 18:59:59', 'http://www.colvenier.be/reserveer.htm'),
(55, 'Karel De Meersman', 'kdemeersman@techdata.be', '0479998736', 'Beste,\r\n\r\nWe zijn op zoek naar een leuk restaurantje om te gaan eten met een 20 tal personen (definitief aantal zal ik later kunnen bevestigen).\r\nDatum: 18/12\r\nBetaling via factuur.\r\nBudget: 120-140  pp (alles incl. dus ook dranken).\r\nHebben jullie nog plaats op 18/12?\r\n\r\nMvg,\r\n\r\nKarel De Meersman, Channel Development Manager      \r\nTech Data bvba/sprl\r\nAssesteenweg 117/1\r\nB-1740 Ternat\r\nTel. +32 2 583 83 38\r\nGSM: +32 479 99 87 36', '2014-12-04 10:22:52', 'http://www.colvenier.be/reserveer.htm'),
(56, 'Ccile Egbers', 'Caecilia.m@gmail.com', '06-21595374', 'Is er op 31 december een speciaal menu ?', '2014-12-06 00:32:34', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=283'),
(57, 'Rita Dijkstra', 'Rita.dijkstra@upcmail.nl', '0627125451', 'Wilt u de reservering van 25-12-2015\r\nvoor 4 personen annuleren.\r\nHelaas! Gaarne bevestigen dat uw dit bericht heeft ontvangen. h.gr. Rita Dijkstra', '2014-12-07 11:13:20', 'http://www.colvenier.be/reserveer.htm'),
(58, 'Siham Lamrini', 'sihamlamrini@hotmail.be', '0486848940', 'Ik ben opzoek naar een IBO ( individuele beroepsopleiding ) plaats.', '2014-12-09 14:18:28', 'http://www.colvenier.be/reserveer.htm'),
(59, 'Siham Lamrini', 'sihamlamrini@hotmail.be', '0486848940', 'Ik ben opzoek naar een IBO ( individuele beroepsopleiding ) plaats.', '2014-12-09 14:28:36', 'http://www.colvenier.be/reserveer.htm'),
(60, 'Kirsten', 'verheydenkirsten@hotmail.be', '0471795561', 'Zijn jullie open met Kerstavond? zo ja, is er een menu en eventueel nog plaats voor  3 personen?\r\nBedankt', '2014-12-09 21:24:51', 'http://www.colvenier.be/reserveer.htm'),
(61, 'Greet Van Laere', 'greet.vanlaere@eplus-engineers.be', '0498581510', 'Geachte\r\nWij plannen op vrijdag 23 januari 2015 omstreeks 19u;\r\nons jaarlijks  nieuwjaars-personeelsdiner te organiseren voor ongeveer 26 personen.\r\nBij voorkeur hadden we deze laten doorgaan in jullie restaurant.\r\nKan ik via deze weg informeren of dat tijdstip nog mogelijk is en \r\nzo ja kunt u me dan een  offerte bezorgen voor een All in formule ;\r\nAperitief\r\nViergangenmenu\r\nAangepaste wijnen\r\nKoffie\r\n\r\n\r\nAlvast bedankt,\r\nGreet Van Laere', '2014-12-10 15:55:04', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=309'),
(62, 'carbon steel flange supplier', 'mviptrust@gmail.com', 'http://www.cnfl', 'Good Day, I read your blogs. Your humoristic style is witty, keepit up! And you can look our website http://cnflanges.com/ about carbon steel flange manufacturer. Thank you very very much.', '2014-12-10 17:26:57', 'http://www.colvenier.be/indexen/book-online.htm'),
(63, 'Troosters Christiana', 'christiana.troosters@telenet.be', '0486966281', 'Is het restaurant geopend op 1 januari ?', '2014-12-11 15:45:41', 'http://www.colvenier.be/reserveer.htm'),
(64, 'Walter Van Campfort', 'walvancam@skynet.be', '0475287717', 'Heeft U ook een eindejaarsmenu en tegen welke projs?', '2014-12-11 16:48:57', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=319'),
(65, 'Verbeeren Philippe', 'Pverbeeren@Levi.com', '0477402581', 'Beste, 1. is er een speciaal oudjaar menu met wijnen inbegrepen of is het mogelijk van 5 of 6 gangen menu te verkrijgen met aangepaste wijnen , indien zo kan je ook de prijs laten weten.', '2014-12-13 19:11:13', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=338'),
(66, 'ntral', 'Salina_jj@hotmail.com', '0649769443', '', '2014-12-14 12:32:08', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=344'),
(67, 'lescrinier theo', 'apotheek.lescrinier@pandora.be', '0475.934.732', 'hello patrick,\r\nKan je de bereiding van de beloofde wildconsomm voor 12 personen ergens deze of volgende week inplannen?\r\ngroeten theo lescrinier', '2014-12-15 13:28:45', 'http://www.colvenier.be/reserveer.htm'),
(68, 'Gert Beuselinck', 'gert.beuselinck@pandora.be', '0484810360', 'Hallo,\r\nBegin volgend jaar bereik ik mijn 25 jarig jubilee op Esso. Dan mag ik een restaurant uit kiezen van een lijst voor een etentje met 18 personen. Huis de Colvenier komt voor op deze lijst. Het budget is 75 euro per persoon. Hebben jullie enkele voorbeeldjes van formules die in deze prijsklasse vallen? \r\nMet vriendelijke groeten\r\nGert', '2014-12-16 10:12:45', 'http://www.colvenier.be/reserveer.htm'),
(69, 'josefina ', 'josefina.sanchezmoriano@ep.europa.eu', '+32486066839', 'Goedenavond, \r\nIs er nog een tafeltje voor 4 personen voor oudejaarsavond beschikbaar?\r\n\r\nMvgr, \r\nJosefina ', '2014-12-16 20:10:44', 'http://www.colvenier.be/reserveer.htm'),
(70, 'Nancy Van Cauwenbergh', 'n.vancauwenbergh@boekenvoordeel.be', '+32 496 537 855', 'Beste,\r\nHebt u op oudejaarsavond, 31/12/2014, nog een tafeltje voor 2 personen? Is er een specifiek menu?\r\n\r\nAlvast bedankt.', '2014-12-17 18:15:42', 'http://www.colvenier.be/reserveer.htm'),
(71, 'Karin Van Tulden', 'kvtulden@its.jnj.com', '0485720003', 'Geachte heer,\r\nZoals gisteren telefonisch besproken zullen we op 19 januari met een 30-tal personen komen dineren (aanvang rond 18.30u.) met eerst een aperitief & hapjes in de kelder en nadien een 3 gangen menu (nog te bespreken) aan de tafel @ 75 all in per persoon..\r\nBegin januari nemen we dan contact met elkaar op om het menu te bespreken.\r\n\r\nBedankt voor de bevestiging\r\n\r\nKarin Van Tulden\r\n', '2014-12-18 12:23:17', 'http://www.colvenier.be/reserveer.htm'),
(72, 'Tian Herstel', 'herstel@jpr.nl', '0031642596809', 'Enige jaren geleden hebben wij bij jullie geweldig gegeten met mijn kantoor. Thans ben ik doende een weekend te organiseren voor mijn tennisteam. Graag informeer ik naar de mogelijkheden op zaterdag 21 maart 2015 voor 6 personen. Gelet op de verscheidenheid van de groep (ook in financieel opzicht) zou ik graag ook vernemen wat de kosten zouden zijn van een menu met wijn.\r\n\r\nMet hartelijke groet,\r\n\r\nTian Herstel', '2014-12-21 13:49:37', 'http://www.colvenier.be/reserveer.htm');
INSERT INTO `question` (`question_id`, `question_name`, `question_email`, `question_gsm`, `msg`, `question_date`, `refurl`) VALUES
(73, 'Annemie Dieltjens', 'a.p@yucom.be', '0476/97.09.87', 'Heeft u een speciale menu voor oudjaar ?\r\nEn heeft u eventueel nog plaats voor 2 personen ? \r\nHartelijk dank voor uw antwoord.\r\nMvg\r\nAnnemie', '2014-12-21 14:03:38', 'http://www.colvenier.be/reserveer.htm'),
(74, 'Anouck Hoet ', 'a.hoet@telenet.bet', '0477292237', 'Onderwerp: Wijndegustatie \r\nBeste, \r\n\r\nGraag zouden we een wijndegustatie doen met 6 of 8 personen in jullie wijnkelders.\r\nWat zijn de mogelijkheden? Is de wijndegustatie uitgebreid? Mogelijkheid om hapjes erbij te doen? \r\n\r\nAlvast bedankt om hier asap op te reageren.\r\n\r\nMvg,\r\n\r\nAnouck Hoet \r\n', '2014-12-23 13:08:10', 'http://www.colvenier.be/reserveer.htm'),
(75, 'ralph lauren norge', 'dijxow@gmail.com', 'http://www.alve', 'Reserve your table\r\n[url=http://www.alvera.no/ty/polo-norge.htm]ralph lauren norge[/url]', '2014-12-25 19:45:20', 'http://www.colvenier.be/indexen/book-online.htm'),
(76, 'Marc Goossens', 'Marc.Goossens110@telenet.be', '0497174548', 'Is het nog mogelijk om voor het 6-gangenmenu voor 3 personen een aangepast wijnarrangement te krijgen en indien dat mogelijk is wat is de prijs daarvoor?', '2014-12-26 14:45:31', 'http://www.colvenier.be/reserveer.htm'),
(77, 'Cindy Capelleman', 'cindy.capelleman@gmail.com', '0478 78 44 04', 'Beste Team De Colvenier,\r\nMorgen, zaterdag 27 dec komen wij bij jullie dineren (uigenodigd door Dhr Van Bael Eric) en hier kijken wij alvast naar uit... anderzijds is dit ook een uitdaging gezien ik om gezondheidsredenen een heel strikt dieet moet volgen waar ik vooraf wou melding van maken.   \r\nVoor alle duidelijkheid, ik verwacht niet dat jullie enorm veel tijd spenderen aan het uitkienen van een menu voor mij.  Ik ben al tevreden met een simpel gegrilde of gestoomde vis gecombineerd met wat toegestane groenten zodat ik toch iets kan eten.   Anderzijds wil ik toch de lijst met verboden producten even doormailen zodat jullie op voorhand op de hoogte zijn van de beperkingen en wie weet zien jullie toch snel nog creatieve mogelijkheden.\r\n\r\nTe vermijden producten zijn:\r\nlook\r\najuin\r\npeper en aanverwanten (niks pikant)\r\nvlees\r\nwitte-groene bonen\r\nzonnebloempitten en dus ook olie\r\npompoen\r\nbroccoli\r\nspruiten\r\ntarwe\r\nspelt\r\neieren\r\nalle suikers (ook zoetstoffen met uitzondering van stevia in weinige mate) \r\nhoning - agave - e.a. ...\r\nalle melkproducten (geit, koe, schaap):  geen yoghurt, kazen, melk,...\r\navocado\r\nbanaan\r\nananas\r\nkiwi\r\nhazelnoot\r\namandelen\r\npeer\r\nchocolade\r\nfruit met hoog suikergehalte\r\ncaffene\r\nthene\r\nBedankt alvast\r\nMvg,\r\nCindy ', '2014-12-26 15:14:38', 'http://www.colvenier.be/reserveer.htm'),
(78, 'bart cassiers', 'bart.cassiers@telenet.be', '0488408701', 'Wij zijn op zoek naar een restaurant voor het kerstetentje op 26 december 2015.We zijn met 40 personen.\r\nIs dat eventueel mogelijk bij jullie?\r\nVriendelijke groeten , \r\n\r\nbart cassiers', '2014-12-27 10:20:36', 'http://www.colvenier.be/reserveer.htm'),
(79, 'Berckmans Armand', 'armand.berckmans@gmail.com', '0475470608', 'graag reservatie voor 2 personen voor oudejaarsavond.\r\nHoe laat komen we best?\r\ndank voor bevestiging', '2014-12-27 12:59:08', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=485'),
(80, 'Job van manen', 'Jobvanmanen@hotmail.com', '0031 6 28 16 56', 'Goedendag, \r\nVorige week hadden we contact over mijn reservering voor 31 december aanstaande. zou ik nog een bevestiging kunnenontvangen aub?\r\nDankuwel,\r\nJob van Manen', '2014-12-27 13:36:51', 'http://www.colvenier.be/reserveer.htm'),
(81, 'Lisa Bisschop ', 'lisabisschop@gmail.com', '0031645827926', 'Beste meneer, mevrouw, \r\n\r\nGraag zouden wij op 31 december bij jullie komen eten met twee personen. Ik eet alleen geen vlees (wel vis) en mag geen gluten en lactose. Is het dan mogelijk bij jullie te dineren? \r\n\r\nHoor het graag. \r\n\r\nMet vriendelijke groet, \r\nLisa Bisschop ', '2014-12-28 14:18:06', 'http://www.colvenier.be/reserveer.htm'),
(82, 'Petra Hibma', 'petrahibma@gmail.com', '+31(0)651219189', 'Is het nog mogelijk om op 31 december te dineren met overnachting voor 2 personen?', '2014-12-29 11:04:01', 'http://www.colvenier.be/reserveer.htm'),
(83, 'Myriam Berghmans', 'info@qmg.be', '0032495586757', 'Geachte,\r\ngraag hadden wij een tafel gereserveerd voor 11 personen voor 9 januari om 19.00 u. Reservatie mag op naam van de heer Van Sante. Dank om de reservering te bevestigen.\r\nMet vriendelijke groet.\r\nMyriam Berghmans', '2014-12-29 11:23:02', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=516'),
(84, 'nancy Van Reeth', 'smet-vanreeth@skynet.be', '0491/075456', 'Beste,\r\nIk heb 25 jaar dienst en mag hiervoor van mijn firma (CSM in Merksem) met 15 personen gaan eten in een restaurant naar keuze, met een max. waarde van 65,- per persoon all-in.\r\nHet is de bedoeling dat de factuur dan naar mijn werkgever wordt opgestuurd.\r\nIk plan dit op vrijdagavond 23 januari.\r\nKunt u me een voorstel doen aub.\r\n', '2014-12-29 18:52:08', 'http://www.colvenier.be/reserveer.htm'),
(85, 'marc schelfhout', 'marc.schelfhout@belcreas.be', '0475 71 68 57', 'ik heb net gereserveerd . Hoe zit het met de tafelschikking voor 12 personen ? Is er een mogelijkheid om aan 1 grote (ronde)tafel te zitten ?  Is er ook een formule all in gaande van aperitief + hapje kelder, water en wijn en koffie', '2014-12-30 10:56:06', 'http://www.colvenier.be/reserveer.htm'),
(86, 'Daniel Degraeve', 'tonyparkerdrums@gmail.com', '0486720607', 'Hallo,\r\nIk had een vraag doorgestuurd om te reserveren. Daar er nog geen antwoord gekomen was en het waarschijnlijk toch volzet zal zijn heb ik ergens anders gereserveerd. Hopelijk geraken we binnenkort toch eens tot bij u. Met vriendelijke groeten, Daniel', '2014-12-30 13:49:03', 'http://www.colvenier.be/reserveer.htm'),
(87, 'Poppe Ronald', 'fepac@skynet.be', '0032475414845', 'Beste Patrick,we zullen maandag spijtiggenoeg maar met 3zijn gezien Nathalie en vriend moeten vliegen.Ik had geopteerd voor de menu ,mag het ook nog a la carte,\r\n,Vriendelijke groeten Ronald', '2014-12-30 17:07:29', 'http://www.colvenier.be/reserveer.htm'),
(88, 'ralph lauren norge', 'atiotyejom@gmail.com', 'http://www.alve', 'Reserve your table\r\n[url=http://www.alvera.no/ty/polo-norge.htm]ralph lauren norge[/url]', '2015-01-05 22:15:18', 'http://www.colvenier.be/indexen/book-online.htm'),
(89, 'Machteld Coenen', 'machteldcoenen_7@hotmail.com', '0488/67 08 81', 'Geachte,\r\nVroeger kon je bij de Colvenier een verjaardagsmenu reserveren.  Een all in voor ongeveer 50 pp. Kan dat nu nog want ik kan dat niet meer op de site vinden.\r\nAlvast hartelijk dank voor de info.\r\nMet vriendelijke groeten,\r\nMachteld Coenen', '2015-01-07 10:56:23', 'http://www.colvenier.be/reserveer.htm'),
(90, 'joris Dirckx', 'joris.dirckx@uantwerp.be', '03 265 34 27', 'i.v.m. reservatie van 8 april voor 10 personen: wij zullen het 5-gangen menu nemen (met aanpassing voor n persoon die alleen vis eet, en twee personen die alleen vegetarisch eten)', '2015-01-09 11:30:12', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=596'),
(91, 'Marc Michiels', 'marc.michiels@merz.com', '0485306422', 'Beste,\r\n\r\nOp 4 februari organiseer ik een avond met 6 artsen in Antwerpen...we zouden rond 19:30 gaan dineren en zou daarvoor graag in de Colvenier willen reserveren.\r\nDaar wij een pharmaceutische firma zijn, zijn we gebonden aan wettelijke maximum tarieven die we Mogen aanbieden aan onze klanten.\r\n\r\nIs het mogelijk om een menu samen te stellen voor 7 personen met alle drunken inbegrepen (wijn, water, koffie) voor 75 euro pp?\r\n\r\nAlvast bedankt voor uw antwoord.\r\n\r\nMvg,\r\nMarc Michiels', '2015-01-09 13:53:50', 'http://www.colvenier.be/reserveer.htm'),
(92, 'Arno Kisters ', 'arno.kisters@gmail.com', '0477799544', 'Ik zou ter gelegenheid van mijn 70 ste verjaardag een diner willen aanbieden voor een 20 tal gasten . Dit op 7 februari rond 19.00 uur . Voorkeur in het salon aan de voorzijde , niet in de tent . Heeft u nog plaatst tegen die tijd.?  Afstemming van diner in overleg met u nadien.', '2015-01-11 13:01:08', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=610'),
(93, 'roger', 'rogerhenderick@yahoo.com', '0034.608732047', 'Geachte heer,\r\n\r\nZaterdag 17.0 ben ik in Antwerpen. Ziet er daar goed en gezellig uit. Wat kosten een kamer en waar kan ik daar beeldmateriaal van bekijken. Uiteraard is het de bedoeling te eten.\r\n\r\ndank voor jouw antwoord,\r\nzonnige groet,\r\n\r\nroger', '2015-01-11 14:25:33', 'http://www.colvenier.be/reserveer.htm'),
(94, 'Stephanie Callaert', 'Stephanie.callaert@triple-living.be', '034918265', 'Beste, \r\nGraag wou ik informeren of er bij jullie de mogelijkheid is om een aparte ruimte te reserveren voor een groep van +/- 20 personen. \r\nZoja, is dit mogelijk op 4 februari?\r\n\r\nMet vriendelijke groeten, \r\nStephanie Callaert', '2015-01-12 11:40:46', 'http://www.colvenier.be/reserveer.htm'),
(95, 'Neyens Tom', 'neyenstom@hotmail.com', '0485141627', 'Beste, \r\nBij deze moet ik spijtig genoeg laten weten dat onze reservatie voor vanavond dient geannuleerd te worden daar ik opgeroepen ben om te gaan werken. Zo zien we maar alweer bij de politie weet je nooit :-s ... de reservatie was op Adams om 18u. Dien ik dit nog telefonisch te bevestigd of is dat zo in orde? \r\n\r\nMvg,\r\n\r\nTom Neyens', '2015-01-15 10:48:03', 'http://www.colvenier.be/reserveer.htm'),
(96, 'nadine van hoof', 'nadine.vanhoof@fdgantwerpen.be', '0487803452', 'Goedemorgen,\r\n\r\nGraag had ik een offerte ontvangen voor een etentje op 22/1/2015 te 19u voor een 30-tal personen. Voor een driegangenmenu met aperitief, halve fles water en halve fles wijn, koffie/thee.', '2015-01-16 09:42:11', 'http://www.colvenier.be/reserveer.htm'),
