(114, 'Gie Vandenbril', 'gie.vandenbril@skynet.be', '03/3852794', 'Ik heb voor de familie Marchal 6 plaatsen gereserveerd voor een diner op vrijdag 6 maart te 19.30 uur.  Door omstandigheden zie ik mij verplicht u te vragen of deze reservatie kan verplaatst worden naar zaterdag 7 maart te 19.00 uur (nog steeds voor 6 personen).  Graag bevestiging per e-mail.', '2015-02-05 18:22:12', 'http://www.colvenier.be/reserveer.htm'),
(115, 'GERALDINE HUYBRECHTS', 'geraldine@borealisdmc.com', '0476 90 11 16', 'Beste\r\n\r\nVoor een zakelijke groep van 60 personen, wensen we graag te weten of u beschikbaarheid zou  hebben voor een diner:\r\nVrijdagavond 12/6/2015\r\nZaterdagavond 13/6/2015\r\n\r\nIndien zo, kunnen we alvast een optie nemen?\r\n\r\nGraag hadden we ook uw menuvoorstellen ontvangen alsook de drankenforfaits.\r\n\r\nAlvast bedankt!\r\n\r\nMet vriendelijke groeten, Cordialement, Kind regards\r\nGeraldine \r\n', '2015-02-11 20:54:10', 'http://www.colvenier.be/reserveer.htm'),
