(118, 'QUARTIER SOPHIE', 'sophie_quartier@hotmail.com', '0486709653', 'Dag Patrick, \r\nTot wanneer loopt jou actie van een diner aan  25. Ons papa vertelde daarover iets, maar wist niet meer juist tot wanneer deze liep, alleen dat deze niet geldig is op vrijdag en zaterdag!\r\nAlvast bedankt en groetjes!\r\nSophie', '2015-02-26 09:50:46', 'http://www.colvenier.be/reserveer.htm'),
