(121, 'Marijke van Ekeren', 'm.vanekeren@zevij-necomij.com', 'N.v.t.', 'Geachte dames, heren,\r\nOp vrijdag 24 april verblijven wij met een grote groep (naar verwachting 40 tot 60 personen) in het Hilton Hotel in Antwerpen. Wij zijn nog op zoek naar een dinerlocatie voor die avond. Over ongeveer 2,5 week weten wij meer over het aantal deelnemers aan dit diner. Bestaat binnen uw restaurant de mogelijkheid om die avond nog met een grote groep bij u te dineren.\r\nGraag vernemen wij van u.\r\nMet vriendelijke groet,\r\nMarijke van Ekeren', '2015-03-02 15:42:13', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=858'),
