(164, 'caresta', 'info@carestaverhuur.be', '0483/01.16.36', 'Beste,\r\n\r\nBent u genteresseerd in de Witte kassa? Zo ja, ons verhuursysteem stelt u in staat op een betaalbare wijze in orde te zijn met de GKS (Geregistreerde Kassa Systeem).\r\nWenst u nadere info van onze raadgevers, dan kan u steeds vrijblijvend een bezoek ter plaatse bekomen.\r\n\r\nMet vriendelijke groeten,\r\nCaresta bvba\r\n', '2015-05-13 17:20:18', 'http://www.wijnbar-antwerpen.be/contact.htm'),
