(190, 'Debbie Hofstra', 'd.hofstra@casema.nl', '0031 646287055', 'Is het mogelijk om op vrijdag middag 19 juni of op zaterdag 20 juni een wijnproeverij te volgen voor 4 personen? En zo ja, wat zijn de kosten?\r\nalvast bedankt voor uw reactie per mail terug!\r\n\r\nDebbie\r\nHuizen (NL)', '2015-06-01 10:47:27', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(191, 'Melvin Broekaart', 'melvinbroekaart@gmail.com', '0031-6-43522421', 'Geachte heer / mevrouw,\r\n\r\nVolgend op de informatie op uw website zou ik graag bij u informeren of de mogelijkheid bestaat tot >>\r\n\r\nHet reserveren van een wijn proeverij met aansluitend een diner (mogelijk elders in de stad)\r\n\r\nWij zijn slechts met een groep van 3 personen, dus aansluiting bij een andere groep / breder event geen probleem.\r\n\r\nBij voorbaat dank voor uw reactie.\r\n\r\nMvg.,\r\nMelvin Broekaart\r\n(+31-6-4352 2421)', '2015-06-01 11:13:31', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(192, 'herve leger bandage dresses', 'duoehnzittg@gmail.com', 'http://composth', 'masque de ski oakley http://mairie-barberey.fr/oakley-jupiter.php masque de ski oakley\r\n[url=http://composthumus.com/herve-leger-pas-cher.htm]herve leger bandage dresses[/url]', '2015-06-01 19:23:54', 'http://www.colvenier.be/indexen/book-online.htm'),
(193, 'Mirte Knieriem', 'mirteknieriem@hotmail.com', '+31651071988', 'Beste Clovenier,\r\n\r\nIk wil zou graag willen weten wat de prijs is van een proeverij voor twee personen en of het mogelijk is om daar 3 personen van te maken.\r\n\r\nMet vriendelijke groet,\r\nMirte', '2015-06-02 12:06:25', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(194, 'herve leger dresses on sale', 'duoehnzittg@gmail.com', 'http://beziersr', 'oakley m frame http://thermosani.fr/oakley-m-frame.html oakley juliet\r\n[url=http://beziersrugby.com/herve-leger-dresses-on-sale.html]herve leger dresses on sale[/url]', '2015-06-02 15:55:39', 'http://www.colvenier.be/indexen/book-online.htm'),
(195, 'Sven Abeloos', 'svenabeloos@gmail.com', '+32475856391', 'Beste,\r\n\r\nIk zou graag een wijnarrangement voor 2 personen cadeau geven aan mijn ouders voor hun 30 jaar getrouwd.\r\nZijn er vaste datums dat dit doorgaat of kunnen ze vrij langskomen?\r\nOp hoeveel zou de prijs ook komen voor 2 personen?\r\n\r\n\r\nMvg,\r\n\r\nSven Abeloos', '2015-06-03 18:23:22', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(196, 'Ana', 'magallon.ana@deme-group.com', '03/250.52.65', 'Beste,\r\nOp donderdag 25/06 zoeken wij een hip restaurant voor een 20-tal collegas die willen genieten van een lekker diner en van elkaars gezelschap.\r\nKan u ons per kerende een voorstel doen voor een 3-gangen menu (met 2 voor-, 2 hoofd- en 2 nagerechten, eventueel een drank/wijnarrangement) ?\r\nIndien u een aparte ruimte heeft voor onze groep zouden wij het ten zeerste appreciren mocht u deze voor ons reserveren.\r\nQua betaling : is het mogelijk om achteraf bij ontvangst van uw factuur te betalen of moet er onmiddellijk afgerekend worden ? \r\nUiteraard kan u mij altijd contacteren voor bijkomende vragen.\r\nMet vriendelijke groeten,\r\n', '2015-06-05 09:33:45', 'http://www.colvenier.be/reserveer.htm');
INSERT INTO `question` (`question_id`, `question_name`, `question_email`, `question_gsm`, `msg`, `question_date`, `refurl`) VALUES
(197, 'marina claus', 'mcmarinaclaus@gmail.com', '0473882518', 'Ik wou graag informeren of we bij jullie ook gewoon een glaasje kunnen komen drinken als apero of is het enkel bedoeld voor degustaties.\r\nalvast dank voor het antwoord\r\nmvg\r\nMarina', '2015-06-11 09:58:34', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(198, 'K.H. Dijksman', 'k.h.dijksman@umail.leidenuniv.nl', '0031651429220', 'Geachte mevrouw, heer,\r\n\r\nGraag wil ik meer weten over een fijne wijnproeverijavond voor twee personen bij u in Antwerpen. \r\n\r\nIk heb een aantal vragen: \r\n\r\nIs het mogelijk om met twee personen te komen? Het gaat ons niet om netwerken maar om gezellig met zn tween te kletsen en te proeven. Kan dat gezellig? Wordt er bij alle wijn wat verteld? Ik ben nog nooit op een wijnproeverij geweest en daarom weet ik eigenlijk niet wat ik kan verwachten. Wat zijn de kosten? Is het de bedoeling dat je ook wijnpakketten koopt?\r\n\r\nIk verneem heel graag van u.\r\n\r\nHartelijke groeten,\r\n\r\nKarin Dijksman', '2015-06-12 10:13:24', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(199, 'Willem Gysel', 'gyselwillem@hotmail.com', '0494906856', 'Beste, we zijn met een aantal vrienden op zoek naar een wijndegustatie voor de verjaardag van 1 van onze beste vrienden. Kan u mij hierover de mogelijkheden + prijzen sturen? We zouden met 6 zijn. Alvast bedankt! Met vriendelijke groeten, Willem Gysel', '2015-06-15 21:27:44', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(200, 'Olivier Voet', 'olivier.voet@uantwerpen.be', '0478 73 47 09', 'Geachte,\r\n\r\nWe zijn op zoek naar een zaaltje voor 40 personen om op woensdag 19 augustus rond 19u een diner the houden.\r\nKlassieke formule: 3-gangen menu met keuze uit vlees, vis of vegetarisch met dranken inclusief.\r\n\r\nIndien u nog plaats heeft kan u mij een hiervoor een prijs en een voorbeeldmenu doorsturen a.u.b.?\r\nAlvast bedankt!\r\n\r\nMet vriendelijke groeten,\r\nOlivier Voet', '2015-06-19 16:21:40', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=1131'),
(201, 'http://gougwfyypvrz.com/', 'iwngrl@czpjmp.com', 'http://gougwfyy', 'SGbze6  <a href=\"http://lwukpiyudlcw.com/\">lwukpiyudlcw</a>, [url=http://nhgvwokyjuwh.com/]nhgvwokyjuwh[/url], [link=http://jixzdjtmogcy.com/]jixzdjtmogcy[/link], http://xrriszqqgdhj.com/', '2015-06-21 05:12:08', 'http://www.colvenier.be/indexen/book-online.htm'),
(202, 'Roy van Oudenaaren', 'royvanoudenaaren@gmail.com', '+31631666768', 'Beste Patrick van Herck,\r\n\r\nwij hebben op zaterdag 15 aug een vrijgezellen partij in Antwerpen. We zijn  met 8 man waarvan de gemiddelde leeftijd rond de 37 ligt. Zou het mogelijk zijn  om een wijn proeverij in de middag te houden', '2015-06-21 22:36:35', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(203, 'Melissa Fontyn', 'melissafontyn24@hotmail.com', '0488/86.23.02', 'Beste,\r\n\r\nik zou graag naar aanleiding van de verjaardag van mijn man, een wijndegustatie vastleggen voor 2 personen. Zijn er vaste datums waarop deze plaatsvinden of is er vrije keuze? Graag ook een indicatie van de prijs per persoon.\r\n\r\nHartelijk dank,\r\nMelissa', '2015-06-23 09:06:22', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(204, 'http://idhytorrtejt.com/', 'ovxzeb@qogdql.com', 'http://idhytorr', 'f2sY3Z  <a href=\"http://bpgmhywtnjzj.com/\">bpgmhywtnjzj</a>, [url=http://wqieewxkndkm.com/]wqieewxkndkm[/url], [link=http://gpzwqombvwur.com/]gpzwqombvwur[/link], http://fzjcfnsxoagp.com/', '2015-06-27 08:23:37', 'http://www.colvenier.be/indexen/book-online.htm'),
(205, 'Hanne Wijnants', 'hanne_wijnants4@hotmail.com', '0472418271', 'Beste,\r\n \r\nWij zouden met een groepje vrienden graag eens wat meer te weten komen over wijn door wijn te proeven.\r\nWe zouden met een vijf  tiental mensen deelnemen.\r\nIk zag reeds dat u verschillende arrangementen heeft. Wat zijn de prijzen voor deze arrangementen? Voor ons hoeft dit niet per se priv, we kunnen ook bij een andere groep aansluiten.\r\n \r\nMet vriendelijke groeten,\r\n \r\nHanne Wijnants', '2015-06-27 10:16:15', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(206, 'Toine Kreijne', 'toinekreijne@hotmail.com', '0639762232', 'Beste,\r\n\r\nWe willen graag een wijnproeverij volgen voor 30 of 31 juli.\r\n\r\nWe zijn met 2 personen.\r\n\r\nWat zijn hier de mogelijkheden van?\r\n\r\nWe horen graag van u', '2015-06-29 23:40:38', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(207, 'Dagmar Dhondt', 'dagmardhondt@gmail.com', '0031647864312', 'Beste meneer of mevrouw,\r\n\r\nVoor het vrijgezellenfeest van mijn schoonzus ben ik opzoek naar een leuke wine tasting. \r\n\r\nHet zou gaan om 5 september in de namiddag. Zouden jullie hier mogelijkheden voor hebben. En zo ja, hoe zou het in zijn werk gaan en hoeveel zou het ongeveer kosten. We hebben een andere schoonzus met een huis in Antwerpen dus het zou ook bij ons thuis kunnen.\r\n\r\nWe zijn met 10 vrouwen.\r\n\r\nIk hoop snel wat van u te horen.\r\n\r\nMet vriendelijke groeten,\r\n\r\nDagmar Dhondt', '2015-06-30 11:42:58', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(208, 'Kegels Emily ', 'emily.kegels@live.be', '0483385549', 'Ik zou graag een duo arrangement wijnproeven boeken voor morgen in de vooravond. Is dit mogelijk voor morgen? Wat bedraagt de prijs? ', '2015-06-30 11:59:54', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(209, 'kathleen bielen', 'kathleen.bielen@gmail.com', '0476693615', 'Beste,\r\nWij zijn op zoek naar een restaurant waar we op zaterdagavond 3 oktober as kunnen komen eten met 75-100 personen in het kader van ons jaarlijks personeelsfeest.(laboratoriumgeneeskunde uzleuven)\r\nOns budget is 75 euro per persoon.\r\nMVG Kathleen', '2015-07-01 11:03:18', 'http://www.colvenier.be/reserveer.htm'),
(210, 'Van Gorp Sally ', 'sallyvangorp@gmail.com', '0474 59 52 72 ', 'Geachte Huis De Colvenier, \r\n\r\nMijn naam is Sally Van Gorp. Staat u mij toe mij even kort voor te stellen. Ik ben 27 jaar, woon in Antwerpen. Ik leerde via facebook dat jullie op zoek zijn naar een internet freak die jullie restaurant kan promoten via social media. \r\n\r\nIk ben hierin heel genteresseerd. \r\nIn de eerste plaats, wellicht de meest belangrijke, ben ik grote fan van jullie restaurant. Ik heb mooie herinneringen van onze familiefeestjes, die uiteraard begonnen in de wijnkelder. \r\n\r\nTen tweede ben ik veel bezig met social media. Het is zelfs zo dat ik voor het restaurant/ bakkerij van mijn ouders de facebookpagina up to date hou. Het gaan hier om een zaak in het zuiden van Spanje, waar ik zelf ook in heb gewerkt. U kan via onderstaande link een kijkje nemen op onze pagina. Dit doe ik ondertussen al vier jaar. Ik heb  veel geleerd van deze periode. \r\nhttps://www.facebook.com/lecafet?ref=bookmarks\r\n\r\nNaast mijn ervaring, heb ik ook een technische achtergrond in communicatie. In 2012 behaalde ik mijn master Politieke Communicatie, aan de universiteit Antwerpen. \r\n\r\nEr zijn immens veel online platformen binnen social media, die relevant zijn voor horeca- zaken. Yelp, tripadvisor, pinterest, naast de dagelijkse fora zoals twitter en facebook. Ik wil graag samen met jullie nadenken over hoe Huis De Colvenier zich het best kan positioneren tussen al dit online geweld. \r\n\r\nUiteraard ben ik steeds bereid om dit alles verder toe te lichten tijdens een persoonlijk gesprek. \r\n\r\nMet vriendelijke groeten, \r\n\r\nSally Van Gorp \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '2015-07-04 09:31:20', 'http://www.colvenier.be/reserveer.htm'),
(211, 'Els Bouden', 'els_bouden@hotmail.com', '0484912232', 'Beste, \r\n\r\nOp 18 juli rond 18h zouden wij graag bij jullie van een wijndegustatie genieten. Dit in het kader van een vrijgezelle-dag. Wij zijn met 6 en de bruid-to-be is een grote fan van Itali. Daarom vroeg ik mij af of een aangepast arrangement met Italiaanse dranken mogelijk is. Zo ja, wat zou dit kosten voor 6 personen, wat is inbegrepen in deze prijs en hoeveel tijd dienen wij hiervoor in te plannen in onze dag. \r\n\r\nAlvast bedankt voor uw antwoord!\r\nMvg,\r\nEls Bouden', '2015-07-07 11:31:31', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(212, 'Rosanne Jansen', 'rosanne@turnkeyevents.nl', '0031402961855', 'Beste,\r\n\r\nIk ben voor een groep van 60 personen op zoek naar een restaurant in Antwerpen om te dineren op 31 oktober. Heeft u hiervoor nog voldoende beschikbaarheid? Zo ja, zou u mij uw groepsopties en prijzen kunnen toesturen? Alvast hartelijk dank.\r\n\r\nMet vriendelijke groet,\r\n\r\n\r\nRosanne Jansen\r\n\r\nTurn Key Business Events bv\r\nGeldropseweg 31\r\nP.O. Box 895\r\n5600 AW  EINDHOVEN \r\nT +31 40 296 18 55\r\nF +31 40 296 18 56\r\nE rosanne@turnkeyevents.nl\r\nW www.turnkeyevents.nl\r\n', '2015-07-07 21:01:56', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=1165'),
(213, 'Laura Klooster', 'LNKlooster@gmail.com', '+31638666467', 'Goedemiddag,\r\n\r\nik zou graag voor 2 personen volgende week zaterdag komen wijnproeven (18juli). Ik zou graag wel de kosten willen weten. ALvast bedankt.\r\n\r\nMet vriendelijke groet,\r\n\r\nLaura Klooster', '2015-07-10 17:37:19', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(214, 'Lien Clee', 'lien_clee@hotmail.com', '0495464952', 'Beste,\r\nWij zouden graag een cadeaubon van jullie restaurant aan iemand cadeau doen. Is dit mogelijk? Zou deze bon eventueel opgestuurd kunnen worden na overschrijving (via post/e-mail) of dient deze opgehaald te worden in het restaurant?\r\nAlvast bedankt!\r\nVriendelijke groetjes, \r\nLien Clee', '2015-07-15 10:49:08', 'http://www.colvenier.be/reserveer.htm'),
(215, 'Nol Heinen', 'nol_heinen@hotmail.com', '0653135030', 'Beste mevrouw/meneer,\r\n\r\nIk was benieuwd naar de prijs voor het wijnarrangement voor 2 personen.\r\n\r\nGroeten,\r\nNol Heinen ', '2015-07-15 12:38:33', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(216, 'Rien Arets', 'rien_arets@hotmail.com', '0499349445', 'Hallo,\r\nWij willen dit doen met een groep van ongeveer 10-15 personen voor een vrijgezellen. Hoeveel zou dit kosten?\r\n\r\nMvg', '2015-07-17 17:37:06', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(217, 'Gallardo', 'blancagallardo1516@gmail.com', '0471012749', 'Hebt u nog plaats voor 45 personen huwelijk op 10/10/2015 om 13u30. interesse in 5 gangenmenu met aangepaste wijnen, waters, koffie en mignardisen. Alvast bedankt Blanca Gallardo', '2015-07-20 14:22:10', 'http://www.colvenier.be/reserveer.htm'),
(218, 'Kirsten Yperman', 'kirstenyperman@hotmail.com', '0496 12 57 21', 'beste,\r\nhebt u ook geschenkbonnen beschikbaar?  Zo ja, hoe werkt dit praktisch?  (ik zou dit aanstaande zaterdag nodig hebben, en ben zelf niet van Antwerpen)\r\nAlvast bedankt voor uw bericht,\r\nMvg,\r\nKirsten Yperman\r\n', '2015-07-20 15:24:45', 'http://www.colvenier.be/reserveer.htm'),
(219, 'Abigail Lafaille ', 'abigail_lafaille@hotmail.com', '0498837930', 'Beste, \r\nIk ben genteresseerd in uw wijnarrangementen/degustaties om de verjaardag van een goede vriendin te vieren. We zouden met een groepje van 3-4 vriendinnen zijn. Wat is de kostprijs van deze degustatie(s)?\r\n\r\nMet vriendelijke groeten,\r\nAbigail Lafaille  ', '2015-07-21 21:52:57', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(220, 'Vincent Pessers', 'pessersv@gmail.com', '0487365125', 'Beste persoon die dit schrijven leest,\r\n\r\nmijn naam is Vincent Pessers. Een jongeling met twintig lentes achter zijn naam. Ik ben een blogger met een Facebookpagina die bijna 2000 likes telt. Op mijn website, die ik op het einde van dit manifest vermelden zal, heb ik wekelijks ongeveer duizend unieke bezoekers en op maandelijkse basis zijn dat er soms tienduizend. \r\n\r\n De reden van dit schrijven is een artikel dat ik zonet las op HLN.be. Daar las ik dat u een exclusieve burger zou serveren. \r\n\r\nIk zou deze graag eens uitproberen en er over schrijven voor op mijn blog. Ik zou het uiteraard begrijpen moest u dit niet zien zitten, het is maar een hersenspinsel dat zich zonet gevormd heeft in mijn hoofd. \r\n\r\nIk zou graag een blog schrijven over deze - toch wel unieke - eetervaring omdat ik denk dat vele mensen zich afvragen hoe deze burger nu eigenlijk is. Het zal, uiteraard, ook vele mensen benieuwd maken, wat dan weer in het voordeel is voor uw zaak. \r\n\r\nAlvorens ik u verlaat: \r\nmoest ik arrogant zijn overgekomen, wil ik even benadrukken dat dat niet de bedoeling is. Ik wil gewoon een aangename, niet alledaagse blog schrijven over de culinaire pracht dat u gemaakt heeft.\r\n\r\nMet vriendelijke groeten, \r\nVincent Pessers\r\n\r\nMijn website: www.vincentpessers.com\r\nMijn Facebookpagina: https://www.facebook.com/pages/Vincent-Pessers/1093905583969834', '2015-07-23 16:48:13', 'http://www.colvenier.be/reserveer.htm'),
(221, 'Evi Lima Marques', 'evi_lima_marques@hotmail.com', '0472790590', 'Beste, ik ben gentresseerd in het wijnarrangement voor 2 personen. Op hoeveel komt deze proeverij en is het mogelijk om wat meer praktische info hieromtrent te krijgen? (data, is dit een priv arrangement of niet,...)\r\n\r\nMet vriendelijke groeten, \r\n\r\nEvi Lima Marques', '2015-07-26 17:57:06', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(222, 'Rosette Libens', 'rosette.libens@gmail.com', '0496475700', 'Goede avond,\r\nMet een aantal personen zijn wij op zoek naar een mooi geschenk voor 3 jarige buren.\r\nKunt u ons enkele formules van wijndegustatie + prijzen hiervan meedelen?\r\nWe zijn zeker van plan om dit ter plaatse te komen bespreken, maar dan hebben we al een idee van een budget.\r\nmet dank en vriendelijke groeten\r\nRosette Libens ', '2015-07-26 18:23:23', 'http://www.wijnbar-antwerpen.be/contact.htm'),
