(226, 'Dennis Kuipers', 'dpkuipers@hotmail.com', '(+31) 06 515145', 'Goedeavond,\r\n\r\nBinnenkort gaat mijn zwager 40 jaar worden. Hoewel ik het nog met overleggen met de familie, ben ik zeer enthousiast geraakt om een wijnproeverij te doen bij u. Kunt u mij een inschatting geven wat de kosten gaan zijn voor 6 personen, voor een proeverij met een hapje erbij? Vriendelijk bedankt, Dennis', '2015-08-09 21:09:35', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(227, 'Inge Ruitenberg', 'i.ruitenberg@hotmail.nl', '+31 0621157748', 'Beste WineBar Colvenier,\r\n\r\nIk zou op zaterdag 24 oktober 2015 graag een wijnarrangement voor twee personen beleven, vanaf - als dit mogelijk is - 16:00 of later (maar als het alleen eerder kan, sta ik hier ook voor open). Ik hoor graag wat de mogelijkheden zijn en wat de prijs is van een dergelijk arrangement. Alvast hartelijk dank voor een antwoord!\r\n\r\nMet vriendelijke groet,\r\nInge Ruitenberg', '2015-08-10 19:59:59', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(228, 'Isabel Di Fede', 'isabel_di_fede@hotmail.com', '0476335447', 'k ben op zoek naar een aangename en sfeervolle locatie voor een verjaardagsfeest met wijndegustatie. Het zou gaan om een 50-tal personen. Mogelijke data zijn 3 of 4 of 10 of 11 oktober. Handig om weten is dat ik eventueel een (jazz)bandje wil voorzien.\r\n\r\nKan u mij laten weten of uw locatie daarvoor in aanmerking komt? En wat de mogelijkheden zijn?\r\n\r\nAlvast veel dank voor uw advies.\r\n\r\nMet vriendelijke groeten, \r\n\r\nIsabel Di Fede', '2015-08-12 12:34:33', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(229, 'saskia Leeuwenburgh', 'sa_lee80@hotmail.com', '+31614694312', 'Goedendag,\r\n\r\nOp zaterdag 10 oktober organiseer ik een dag antwerpen voor 12 vrouwen. gedurende de dag verplaatsen wij ons door de stad antwerpen voor allerlei bezienswaardigheden en activiteiten. Graag zou ik tijdens deze dag als een van de activiteiten willen wijnproeven. Ik heb vernomen dat wij dit bij u moeten doen. Kunt u mij meer informatie mailen betreft de mogelijkheden en prijzen van een wijnproeverijtje.\r\n\r\nAlvast erg bedankt voor de informatie.\r\nGroeten,\r\nSaskia Leeuwenburgh\r\n', '2015-08-18 14:40:23', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(230, 'Bruno Demonie', 'bruno.demonie@telenet.be', '0479319765', 'Waar kan ik meer informatie vinden over jullie hotelkamers?  Prijs, voorzieningen, ...', '2015-08-20 14:39:54', 'http://www.colvenier.be/reserveer.htm'),
(231, 'Krystel Dries', 'krysje.dries@hotmail.com', '0484763113', 'Beste,\r\nGraag had ik mijn vader voor zijn verjaardag een wijndegustatie cadeau gedaan. Kan u me zeggen wat de prijs voor 2 personen hiervan bedraagt?\r\nMvg\r\nKrystel Dries', '2015-08-21 18:53:56', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(232, 'Dimitri Desmet', 'desmet.mckee.wedding@gmail.com', '0486978855', 'Beste,\r\n\r\nGraag had ik geweten of jullie plaats hebben voor een late lunch (14:00) voor een groep van 20~25 personen op 24 oktober 2015. Ideaal zouden we een grote tafel hebben waar iedereen aan kan zitten. \r\n\r\nHet zou ter gelegendheid zijn van een huwelijk. Indien ja, welke mogelijkheden zijn er voor de menu? \r\n\r\nMet vriendelijke groeten,\r\nDimitri Desmet\r\n', '2015-08-23 18:36:42', 'http://www.colvenier.be/reserveer.htm'),
(233, 'Steve Dekkers', 'steve.dekkers@telenet.be', '0485390060', 'Beste,\r\nWij hebben een reservatie op 12/09 voor 4 personen om 19.30. Wij brengen onze tienerdochter van 13 mee,heeft u eventueel ook een aangepaste versie van het menu of een kindermenu ? \r\nAlvast bedankt\r\nMvg fam Dekkers Steve', '2015-08-24 18:36:13', 'http://www.colvenier.be/reserveer.htm'),
(234, 'Rita Jordens', 'rita.jordens@scarlet.be', '0484 47 41 97', 'kunnen wij ook logeren, en de prijs a.u.b\r\nis er garage of parking in de buurt..\r\ngroeten\r\nRita', '2015-08-26 17:22:52', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=1307'),
(235, 'Sam Sollie', 'samsollie@hotmail.com', '0478512636', 'Beste,\r\n\r\nIk ben Sam Sollie en ben voor mijn beste vriend op zoek naar een geschikt cadeau voor zijn verjaardag.\r\n\r\nIk heb op jullie website gelezen dat jullie wijndegustaties voor twee personen organiseren.\r\nDat lijkt mij een perfect cadeau voor hem.\r\nHebben jullie een cadeaubon voor een wijndegustatie voor 2 personen bij jullie? En hoeveel kost deze?\r\n\r\nMet vriendelijke groeten,\r\n\r\nSam Sollie', '2015-08-26 19:02:42', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(236, 'Maud', 'maudkallen@gmail.com', '0031681956835', 'Hallo, \r\n\r\nWij zijn genteresseerd om op zaterdag 19 september met een groep van 7 dames een wijnproeverij te doen. Graag ontvangen we een prijsopgave om 6 soorten wijn te proeven en de mogelijkheden qua tijdstippen.   \r\n\r\nWe merken op dat 1 persoon geen witte wijn drinkt, dus zij zou graag 6 rode wijnen proeven, is dit mogelijk?\r\n\r\nDank alvast en we horen graag van u.\r\n\r\nMaud Kallen ', '2015-08-29 16:41:46', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(237, 'Van den Broeck', 'filip.van.de.broeck@telenet.be', '0478/76.29;88', 'Beste,\r\n\r\nIs het restaurant geopend op 25 december? \r\nMet vriendelijke groet.\r\nVan den Broeck Filip', '2015-08-31 20:04:58', 'http://www.colvenier.be/reserveer.htm'),
(238, 'Ellen Beyers', 'ellen.beyers@gmail.com', '0475259411', 'Beste, \r\nIk ben op zoek naar een wijnproeverij voor 2 personen. Er mogen eventueel andere mensen aanwezig zijn, maar zou het graag kleinschalig houden. Is het mogelijk een prijsofferte op te maken en enkele beschikbare data door te geven aub? Op zaterdag en zondag komt het ons niet zo goed uit. Alvast bedankt, \r\nEllen Beyers', '2015-09-01 11:48:42', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(239, 'Van Craen', 'cindyvc@hotmail.com', '0475260400', 'Beste,\r\n\r\nIs het mogelijk om eens op een avond (bv. dinsdagavond 29 september rond 20.30u) te komen proeven. Ik en mijn man. ', '2015-09-03 18:00:43', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(240, 'Arne De Jongh', 'arnedejongh@hotmail.com', '0471211854', 'Beste,\r\n\r\nGraag had ik een wijndegustatie voor 2 personen cadeau gedaan. Kan u mij vertellen wat de prijs is en hoe ik een bon hiervoor zou kunnen verkrijgen?\r\n\r\nBedankt,\r\nArne', '2015-09-06 09:46:40', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(241, 'Van Elsacker Hedwig', 'ronny.standaert@telenet.be', '0498 07 77 99', 'Beste\r\nWij hebben interesse in het wijn arrangement voor 10 personen. Kan u ons een prijs geven voor 6 en 8 wijnen aub?\r\nHartelijk dank\r\nHedwig\r\n\r\n', '2015-09-08 14:51:33', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(242, 'Inge Ruitenberg', 'i.ruitenberg@hotmail.nl', '+31 6 211 577 4', 'Beste WineBar Colvenier,\r\n\r\nIk heb zojuist gebeld over een reservering voor een wijnarrangement voor 2 personen op zaterdag 24 oktober om 16:00. Ik mail u nu voor een nadere invulling van dit arrangement. U heeft mij zojuist verteld dat de kosten minimaal 50 euro per persoon zijn. Ik zou de kosten graag beperken tot maximaal 75 euro per persoon. Ik hoop dat er met dit budget een leuke wijnproeverij valt samen te stellen en hoor dit graag van u. Alvast hartelijk dank voor een reactie!\r\n\r\nMet vriendelijke groet,\r\nInge Ruitenberg ', '2015-09-11 11:09:39', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(243, 'C.Fodderie', 'camille.fodderie@skynet.be', 'geen', 'Ik had graag een cadeau bon geschonken\r\nKan dit via mail geregeld worden ?', '2015-09-12 09:50:44', 'http://www.colvenier.be/reserveer.htm'),
(244, 'Linda Willemen', 'linda.willemen@outlook.com', '0473 30 22 76', 'Beste,\r\nMijn broer wordt in december 65 en de familie wil hem een etentje cadeau doen (6 personen in totaal). \r\nVraag 1: Ik dacht op uw site bij de menukeuzes ook een optie \"all-in\" voor 55  gezien te hebben, maar die vind ik nu niet meer terug... Is dat nu niet meer van toepassing?\r\nVraag 2: zou het ook mogelijk zijn om een verjaardagstaart(je)/dessert te voorzien en hoeveel zou dat meer kosten?\r\nVraag 3: aansluitend willen wij een theatervoorstelling meepikken in het EAT. De voorstelling begint om 20.15. Aanvang diner om 17.00 u.: zou dat voldoende zijn?\r\nAlvast hartelijk dank voor de info!\r\nLinda Willemen', '2015-09-14 14:26:36', 'http://www.colvenier.be/reserveer.htm'),
(245, 'Chantal Jansen', 'chantal__jansen@hotmail.com', '0646787902', 'Dag, \r\n\r\nIk was benieuwd naar de prijzen voor een wijnproeverij voor 8 personen. \r\n\r\nMet vriendelijke groet, \r\nChantal Jansen. ', '2015-09-15 12:11:10', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(246, 'Tom Rottiers', 'Tom.rottiers@emeritis.com', '0474 35 77 70', 'Beste,\r\n\r\nIk zou graag als teamevent een wijnproeverij organiseren.\r\nWe zouden met een groep tussen de 15 en 20 personen zijn (nog te bevestigen).\r\n\r\nDe bedoeling zou zijn om een aantal karakteristieke witte en rode wijnen te kunnen proeven, vergezeld van een hapje.\r\n\r\nIs dit mogelijk bij jullie?  Indien ja, zou het mogelijk zijn om een budgetindicatie door te sturen?  \r\n\r\nWe zouden dit tijdens de maand oktober willen organiseren (15/10 of 29/10).\r\n\r\nGroeten en alvast bedankt voor uw reactie,\r\n\r\nTom\r\n', '2015-09-15 19:43:43', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(247, 'Karel Vangenechten', 'carolus.vangenechten@telenet.be', '0494817876', 'Kan u ons een voorstel geven voor een fijn avondmaal en een nacht voor 2 personen? Kunnen we ook een cadeau cheque bekomen, waarmee we een aanzet kunnen betalen?', '2015-09-17 09:46:14', 'http://www.colvenier.be/reserveer.htm'),
(248, 'Gunther Valckenier', 'gunther.valckenier@gmail.com', '0495415409', '\r\nKollecTiv Trio muziek voor al uw evenementen en happenings\r\nHet KollecTiv trio brengt de perfecte muziek voor al uw evenementen, feesten en happenings. Wij brengen een jazzy repertoire gebracht door professionele muzikanten. Door deze bezetting past onze muziek perfect in een intiem kader gaande van huiskamer, lounge en clubconcerten maar alsook feesten, recepties en evenementen.Het repertoire is bewerkt voor Gitaar-Piano-Contrabas wat zorgt voor een originele uitvoering van deze muziek. Op vraag en naargelang de gelegenheid brengen we ons programma ook in een Zang-Gitaar-Contrabas bezetting.Wij passen ons aan aan uw wensen.\r\nBeide bezettingen verzorgen een uitvoering welke geschikt is voor zowel luisterpubliek als achtergrondmuziek. \r\n\r\n\r\nKollecTiv Trio is een formatie binnen KollecTiv bestaande uit:\r\n\r\n                        -  Gunther Valckenier: Gitaar\r\n                        -  Fania Rodriguez Gonzales: Piano\r\n                        -  Ondine Quackelbeen: Contrabas\r\n\r\nen kan zoals eerder gezegd met zang  uitgebreid worden.\r\n\r\n   -  Gunther Valckenier: Gitaar\r\n                         - Oljana Weyler: Zang\r\n                         -  Ondine Quackelbeen: Contrabas\r\n\r\nBij boeking van het Trio kan U steeds uw voorkeur geven in welke bezetting wij onze uitvoering brengen.\r\n\r\nMocht U interesse of vragen hebben kan U mij steeds contacteren op gunther.valckenier@gmail.com of tel 0495 415 409                                              \r\nBezoek ook onze website www.KollecTiv.be\r\n\r\n-- \r\nGunther Valckenier\r\n+32495415409\r\n\r\n-- \r\nGunther Valckenier\r\n+32495415409', '2015-09-17 20:26:20', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(249, 'Moeremans Clarina', 'clarinamoeremans@hotmail.com', '0472449716', 'Beste\r\nWij hadden graag willen weten of in het drie gangen menu de eendebout vervangen kan worden door een ander gerecht? \r\nVriendelijke groeten ClarinaMoeremans', '2015-09-18 14:45:12', 'http://www.colvenier.be/reserveer.htm'),
(250, 'huybrechts', 'marc@obb62.be', '0499 35 44 34', 'Beste,\r\nwe zouden graag met een bevriend koppel ( dus 4 personen) komen degusteren. Moeten wij reserveren ( zou op zat 10/10/15 zijn)? Wat kost dit per persoon?\r\n\r\nAlvast bedankt voor uw reactie\r\n\r\nMarc', '2015-09-22 14:03:22', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(251, 'van oppens dimitri', 'dimi_noppie@hotmail.com', '0486299419', 'kan er bij jullie op vrijdagavond gewoon gezellig een glaasje komen gedronken worden of zijn het enkel arrangementen?', '2015-09-23 14:10:09', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(252, 'Kees Konings', 'kees.konings@home.nl', '0031621567611', 'Geachte heer/mevrouw,\r\nVoor een zakelijk afscheidsdiner voor 5 personen dd 19 november wilde ik u vragen of het mogelijk is (tegen kurkengeld) zelf 1 rode wijn mee te nemen uit eigen kelder die voor mij voor deze gelegenheid bijzonder is.\r\nMet vriendelijke groet,\r\nCJA Konings', '2015-09-23 16:55:49', 'http://www.colvenier.be/reserveer.htm'),
(253, 'Laura van Gompel', 'vangompel.l@gmail.com', '0495238899', 'Beste, \r\n\r\nJullie concept van wijnproeven klinkt heel interessant! Hoeveel kost het om met 4 personen te komen wijnproeven? Alvast bedankt voor de info.\r\n\r\nMvg, \r\n\r\nLaura van Gompel ', '2015-09-25 11:46:31', 'http://www.wijnbar-antwerpen.be/contact.htm'),
