(255, 'Tom Goossens', 'tom@goossensadvocaten.be', '0477/21.00.18', 'Goedemorgen,\r\nIk had bij jullie gereserveerd voor 7pp voor morgenmiddag maar moet door onvoorziene omstandigheden deze afspraak helaas annuleren. Mijn excuses voor het ongemak en graag tot een volgende keer!\r\nMvg, Tom Goossens', '2015-09-28 10:05:33', 'http://www.colvenier.be/reserveer.htm'),
(256, 'Sara Harrison', 'sh6foxylady9@aol.com', '07557407958', 'Hello :)\r\nMyself and my partner will be visiting Belgium on the 28/12/15 - 01/01/16 from England, I have been to your  restaurant before and would love to share the experience with my partner. Is there any possibility that you have any availability during these dates at all,  at any time??\r\nYours hopefully.....Sara x\r\n\r\n', '2015-09-28 18:54:55', 'http://www.colvenier.be/indexen/book-online.htm'),
