(259, 'Bob Daems', 'bobdaems87@gmail.com', '0472 47 29 77', 'Beste,\r\n\r\nIk had graag voor 2personen een wijndegustatie gereserveerd voor 12 oktober rond 19u30. Is er dan nog plaats?! \r\n\r\nMvg,\r\n\r\nBob Daems', '2015-10-02 12:07:26', 'http://www.wijnbar-antwerpen.be/contact.htm'),
