(261, 'ROBIJN BEN', 'ben.robijn@outlook.com', '0477 402 116', 'Geachte,ik zou graag eens komen eten met mijn geliefde (datum weet ik nog niet), maar zou er dan gezorgd kunnen worden voor een romantische sfeer, ik bedoel kaarsjes, en een rustig muziekje. \r\nAlvast bedankt voor jullie antwoord.\r\nMet vriendelijke groeten,\r\nRobijn Ben.', '2015-10-05 08:08:48', 'http://www.colvenier.be/reserveer.htm'),
(262, 'Marloes', 'marloesmartens@hotmail.com', '+316 21922991', 'Beste Winebar,\r\nIk verneem graag hoe duur een wijnarragement is voor 2 personen en of dit eventueel mogelijk is tussen 22 en 24 oktober. \r\n\r\nMet vriendelijke groet,\r\nMarloes Martens', '2015-10-05 12:10:18', 'http://www.wijnbar-antwerpen.be/contact.htm'),
