(265, 'Carl Wyckmans', 'carl.wyckmans@telenet.be', 'GSM 0474 296145', 'Beste,\r\nstel dat we met zes personen een 3 gangen willen komen eten maar twee daarvan hebben last met gluten en lactose. hoeo zou u dat oplossen?\r\nAlvast bedankt\r\nCarl', '2015-10-06 16:44:49', 'http://www.colvenier.be/reserveer.htm'),
