(267, 'marleen van dorsselaer', 'marleen_van_dorsselaer@hotmail.com', '0497854142', 'Graag wou ik weten of het restaurant open is op kerstdag 25 december.\r\nEn zo ja, of er dan een speciaal menu is.\r\nGroeten', '2015-10-06 19:37:21', 'http://www.colvenier.be/reserveer.htm'),
(268, 'christine', 'christineschraepen@gmail.com', '0468116285', 'Geachte meneer\r\n\r\nMijn partner en ikzelf zouden graag een trouw in besloten kring willen organiseren in het centrum van Antwerpen. Ik was op zoek naar een klasserestaurant met aparte zalen en kwam zo bij de Colvenier uit. Het idee van de aperitief in de wijnkelder lijkt mij leuk en origineel. Zou u mij kunnen laten weten of u een groep van 25 tot max. 30 mensen voor een vijf-gangen-menu all in kan ontvangen ergens tijdens de zomermaanden juli of augustus. Geen nood, er komt geen dansfeest aan te pas, misschien wel (en enkel met uw toestemming) een live pianist (die een klassiek en jazzrepertoire verzorgt als achtergrond muziek). Onze precieze trouwdatum ligt nog niet vast maar we wilden reeds op voorhand polsen of dit iets is dat u kan en wil doen. Indien u een jaarlijkse sluiting heeft die toevallig tijdens deze maanden valt, dan houden we daar alvast rekening mee.  \r\n\r\nWachtend op uw antwoord, danken wij u bij voorbaat\r\n\r\nMiguel en Christine', '2015-10-12 20:04:32', 'http://www.colvenier.be/reserveer.htm'),
(269, 'Roland Vanheffen', 'r.vanheffen@skynet.be', '03/6648643', 'Annulatie van lunch op 16/10/2015\r\n2 personen', '2015-10-14 15:13:35', 'http://www.colvenier.be/reserveer.htm'),
(270, 'Tijn Bresser', 'tijn@ct-company.nl', '+31-6-12476536', 'Voor een CEO netwerkclub van Benelux foodbedrijven zoek ik een \"kerstdiner\" locatie voor 20 man. Ontvangst ca. 17u met amuses / champagne. 4 gangen met aangepaste wijnen. Koffie arrangement. Gesloten ruimte ivm speeches. Datum dinsdag 15 december. Is dit mogelijk bij u? Heeft u misschien een afbeelding van de zaal? Hartelijke groet, Tijn', '2015-10-14 19:26:54', 'http://www.colvenier.be/reserveer.htm'),
(271, 'De bruyn Jorinne', 'jodebruyn@deloitte.com', '0472900519', 'Beste, \r\n\r\nIk zou een team event moeten regelen voor onze teambuilding met Deloitte Transfer Pricing team. \r\n\r\nWe zouden ongeveer met 30 personen zijn, en het zou door moeten gaan op een avond vanaf zes uur (ergens in november). \r\n\r\nHierbij zou er liefst ook eten / tapas voorzien moeten worden, aangezien we allemaal rechtstreeks van het werk komen. \r\n\r\nMvg\r\nJorinne De bruyn', '2015-10-15 08:55:32', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(272, 'spiessens', 'dieudonne.spiessens@telenet.be', '0478213565', 'middagdiner op 6 nov ek.\r\nMiddagdiner op 6 nov ek.\r\nmin 8 p., max. 10 p.\r\n\r\n\r\n\r\n', '2015-10-16 11:16:06', 'http://www.colvenier.be/reserveer.htm'),
(273, 'Thalia Swysen', 'thaliaswysen@gmail.com', '0494030779', 'Beste, \r\n\r\nBij deze zou ik u graag willen vragen of het mogelijk is, om het arrangement voor 2 personen, als cadeau te geven? Ook zou ik hier bij nog een extra bedrag willen geven voor eventuele hapjes.\r\n\r\nAlvast bedankt voor uw reactie!\r\n\r\nMet vriendelijke groeten \r\nThalia Swysen', '2015-10-16 14:40:27', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(274, 'Annika Vos', 'Mizz_annika@hotmail.com', '0640296940', 'Hallo,\r\n\r\nSamen met mijn zus ga ik binnenkort een weekend naar Antwerpen toe. Het leek mij leuk om voor haar verjaardag een wijnarrangement/proeverij te doen voor 2 personen. Echter kan ik geen prijzen vinden op jullie website.\r\nZouden jullie kunnen aangeven wat de kosten zijn voor 2 personen?\r\nAlvast bedankt.\r\n\r\nMet vriendelijke groet,\r\nAnnika Vos', '2015-10-17 17:30:12', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(275, 'Stan van Geilswijk', 'stanvangeilswijk@hotmail.com', '06-15887170', 'Goedendag, \r\n\r\nIk zag op uw site dat u een wijnproeverij aanbied voor 2 personen. Ik zou hier graag meer informatie over willen horen. is het bijvoorbeeld mogelijk op zaterdagavond of middag 14 november en wat zouden de kosten hiervoor zijn. \r\n\r\nMet vriendelijke groet, \r\n\r\nStan van Geilswijk', '2015-10-20 14:24:51', 'http://www.wijnbar-antwerpen.be/contact.htm'),
