(277, 'Tim van Dijk', 'tim.van.dijk@brabantwater.nl', '0031647272549', 'Beste meneer van Herck,\r\n\r\nIk ben van het ingenieursbureau van het drinkwaterbedrijf Brabant Water en organiseer dit jaar onze teambuilding. Dit wil ik graag afsluiten bij uw restaurant. Het betreft woensdag 18 November. Ik gaat om een groep van ca 30-35 man en ik ben benieuwd wat u ons kunt aanbieden qua menu en prijzen. \r\n\r\nIk hoor graag van u,\r\n\r\nmvg,\r\nTim van Dijk', '2015-10-22 13:38:43', 'http://www.colvenier.be/reserveer.htm'),
(278, 'Erwin VAN DEN SANDE', 'erwin.van.den.sande@telenet.be', '0473631361', 'Beste,\r\nmisschien ben ik nog te vroeg, maar is het menu voor oudejaarsavond al bekend, en kan er desgevallend al gereserveerd worden ?\r\nGroet,\r\nErwin', '2015-10-22 17:52:41', 'http://www.colvenier.be/reserveer.htm'),
