(281, 'Marthe Rikken', 'marthe.rikken@live.nl', '06-29490279', 'Geachte heer/mevrouw,\r\n\r\nIn januari ga ik een paar dagen naar Antwerpen met mijn vriend. Aangezien hij jarig is geweest zou ik dan graag voor zijn verjaardag een wijnproeverij doen samen. \r\nWat bedragen de kosten hiervoor?\r\n\r\nMet vriendelijke groet,\r\nMarthe Rikken', '2015-10-25 20:18:48', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(282, 'sarah cant', 'sarah_cant111@hotmail.com', '0476864813', 'Beste,\r\n\r\nIk heb gelezen dat u een wijnarrangement heeft voor 2 personen. Als je zoiets wilt doen, is dit dan met reserveren of kan je gaan wanneer je wilt? Kan ik dit ook op een of andere manier via een bon ofzo als cadeau geven? En als laatste, wat kost zoiets voor de 2 samen? \r\n\r\nAlvast bedankt,\r\nMvg', '2015-10-26 09:22:45', 'http://www.wijnbar-antwerpen.be/contact.htm'),
