(284, 'Carina van Beers', 'carinavanbeers@hotmail.com', '0612457791', 'Beste,\r\n\r\nAls cadeau voor mijn partner ben ik heel erg genteresseerd in jullie wijnproeverij voor 2 personen.\r\nNu zat ik zelf te denken aan zondag 6 December.\r\n\r\nIk hoor heel graag wat de mogelijkheden zijn.\r\n\r\nMvg,\r\n\r\nCarina van Beers', '2015-10-28 11:42:27', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(285, 'Martine Snijder', 'martine.snijder@nelsoninspires.be', '0474247661', 'Goedemiddag,\r\n\r\nOp 4 en 5 december organiseren wij, firma Nelson, in Antwerpen het nationale congres voor Belgische urologen (BAU2015).\r\n\r\nOp vrijdag 4 december voorzien wij een dagprogramma voor de partners van de urologen.\r\nZou u zo vriendelijk willen zijn om ons uw lunchvoorstel alsook uw prijs te geven voor een lunch met koffie voor 15  20 personen ?\r\n\r\nHartelijk dank voor uw snelle antwoord !\r\n\r\nMet vriendelijke groeten,\r\n\r\n\r\nMartine Snijder\r\nNeslon Group\r\nT: 016/ 28 46 10', '2015-10-29 11:52:56', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=1534'),
(286, 'Tomas Bogaerts', 'bogaertstomasj@hotmail.com', '0031613284923', 'Voor een vrijgezellenfeest ben ik op zoek naar een leuke proeverij van wijnen en mogelijk enkele hapjes. Zou dit eventueel mogelijk zijn op zaterdag 21 november aanstaande? Voorbaat dank en groet, Tomas Bogaerts', '2015-11-02 21:46:06', 'http://www.wijnbar-antwerpen.be/contact.htm'),
