(288, 'Legrand Paul', 'paulrosylegrand@telenet.be', '0499 35 07 81', 'Geachte Heer,\r\nIk zou graag een feestje organiseren voor mijn echtgenote die 70 jaar wordt. Kan dat in Uw restaurant.\r\nDatum nog te bespreken: zaterdag 23/01/2016 of zaterdag 30/01/2016 om 19 uur. Voor een 18  20-tal personen.\r\nKan U ons contacteren om dit te bespreken?\r\nMet beleefde groeten.\r\nLegrand Paul\r\n\r\n', '2015-11-03 13:49:20', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=1559'),
