(292, 'Eddy.H van de Velde', 'Eddyvdveld@zeelandnet.nl', '0031622856928', 'Patrick Stuur mij svp een bevestiging van de reservering voor 25-12-2015 Heb dit zo pas via site gedaan. Kan de bevestiging echter nier uitprinten. Bij voorbaat dank Eddy en Lenie', '2015-11-09 18:50:37', 'http://www.colvenier.be/reserveer.htm'),
(293, 'Ronny Madereel', 'ronnymadereel@gmail.com', '0034603757781', 'Geachte,\r\n\r\nBij deze wou ik even informeren of jullie een speciale menu hebben voor  Oudejaarsavond (31 december)?\r\n\r\nMvg,\r\n\r\nRonny Madereel\r\n', '2015-11-11 12:22:01', 'http://www.colvenier.be/reserveer.htm'),
(294, 'Sofie van den bussche', 'sofievandenbussche@hotmail.be', '0497888593', 'Goedemiddag, \r\n\r\nIk ben dinsdag langs geweest voor een eventuele wijndegustatie.\r\nWij hadden graag een menu van 60 euro per persoon met de aperetief in de kelder en de wijnen aan tafel.\r\n\r\nIs dit mogelijk om dit door telaten gaan maandag 14 december?\r\n\r\nMet vriendelijke groeten\r\nSofie', '2015-11-12 11:44:04', 'http://www.colvenier.be/reserveer.htm'),
(295, 'Anton Tielen', 'anton.tielen@companysuits.nl', '+31-6-51860902', 'Geachte heer,\r\n\r\nWij hebben elkaar gisteren gesproken en we zouden graag zaterdag 21 November in uw wijnkelder met 3 personen tussen 16.30-17.30 een heerlijke fles wijn willen proeven.\r\nWe stappen af van een wijnproverij maar zouden gelijk een heerlijke bijzondere fles willen nuttigen.\r\nWat zou u ons kunnen aanbevelen ?\r\nTevens de vraag of we een korte uitleg of het pand / historie kunnen krijgen dan wel een korte uitleg over de wijn.\r\nHet hoeft niet hoogdravend te zijn maar gezellig en gemoedelijk.\r\n\r\nHoor graag van u of dat dat mogelijk is?\r\n\r\nGroeten,\r\nAnton Tielen ', '2015-11-12 14:16:46', 'http://www.colvenier.be/reserveer.htm'),
(296, 'wies frijters', 'wies_frijters@hotmail.com', '+31 648250122', 'Omdat mijn moeder binnenkort 60 jaar wordt, willen we haar verrassen met een wijnproeverij. Ik kan geen prijzen op jullie site vinden. Ik ben benieuwd wat een wijnproeverij voor 5 personen kost en hoeveel wijnen proef je dan? Hoeveel tijd ben je ongeveer kwijt en als we losse hapjes bijbestellen is dat dan voldoende zodat we niet ook nog uit eten moeten.\r\nMvg Wies Frijters\r\nRoosendaal - NL', '2015-11-12 16:24:34', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(297, 'Patrick Devos', 'p.devos.ruien@telenet.be', '+32 486 23 85 7', 'Is er een speciale menu voorzien op kerstavond', '2015-11-12 20:24:49', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=1603'),
(298, 'Sofie fens', 'sofie@hrnetworking.be', '0474589348', 'Beste,\r\n\r\nWat is de prijs voor het wijnarrangement voor 2 personen?\r\n\r\nAlvast bedankt voor uw reactie.\r\nMvg,\r\nSofie Fens', '2015-11-14 14:57:55', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(299, 'Vanessa Hoekema', 'vanessahoekema@hotmail.com', '0647082661', 'Geachte heer/mevrouw,\r\n\r\nIs er een mogelijkheid om een wijnproeverij voor 2 personen bij u te reserveren op zaterdag 12 december om 16.30 uur? En wat zijn daar de kosten voor? Hoor graag, alvast hartelijk dank!\r\n\r\nVriendelijke groet,\r\n\r\nVanessa Hoekema', '2015-11-16 09:17:41', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(300, 'Louis Ph. Vos', 'vos.zelf@inter.nl.net', '0654995680', 'zie boven', '2015-11-17 16:17:02', 'http://www.colvenier.be/reserveer.htm'),
(301, 'Diederik Swart', 'info@croatiangrapes.com', '+31648269099', 'Geachte wijninkoper,\r\n \r\nGraag zouden wij met u willen samenwerken.\r\n\r\nPS:trading / Croatiangrapes.com is een wijnimporteur voor de Benelux met een assortiment van topwijnen uit Kroati, een land met een eeuwenlange geschiedenis op het gebied van wijnproductie. Kroatische wijn is enorm in opkomst. Diverse toprestaurants in New York hebben er al voor gekozen om Kroatische wijnen op de kaart te zetten.\r\n \r\nEen aantal van onze wijnen is reeds door de bekende Nederlandse vinpressionist Hubrecht Duijker uitgeroepen tot Vondst van de maand. Daarnaast hebben wij wijnen in het assortiment die medailles gewonnen hebben bij de International Wine Challenge en de International Balkans Wine Competition.\r\n \r\nOnze wijnen zijn allemaal gemaakt van unieke autochtone Kroatische druiven door wijnmakers met bijzonder veel passie. Een aantal van onze wijnen is eco-gecertificeerd.\r\n \r\nWij importeren alle wijnen zelf en wij hebben met al onze wijnhuizen een exclusiviteitovereenkomst voor de Benelux. Onze wijnen zijn dus uniek en exclusief op de Belgische markt.\r\n \r\nGraag zouden wij u kennis willen laten maken met ons assortiment. Wij sturen u nu wat documentatie, maar uiteraard is er geen betere manier om een wijn te ervaren dan hem te proeven.\r\n \r\nOp 24, 25 en 26 november zijn wij bij u in de regio. We komen graag bij u langs voor een proeverij. Wij horen dan ook graag van u of u interesse hebt om onze wijnen te proeven.\r\n\r\n\r\nMet vriendelijke groet / Kind regards / Lijepi pozdravi,\r\n\r\nMario Prani & Diederik Swart\r\nCroatiangrapes.com\r\n\r\nE: info@croatiangrapes.com\r\nU: www.croatiangrapes.com\r\nT: +31 20 7727737\r\nM: +31 6 55141375\r\n\r\nLike us: https://www.facebook.com/croatiangrapes', '2015-11-19 09:16:06', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(302, 'Peter Cotteleer', 'peter.cotteleer@hotmail.com', '+31613197159', 'Heb net gereserveerd op 26.12.2015 met het 6 gangen menu 90. Nu zie ik dat jullie een kerst & nieuwjaars menu hebben. Is deze ook verplicht deze te nemen op de 26.12.2015. Alvast bedankt.', '2015-11-21 16:46:31', 'http://www.colvenier.be/reserveer.htm'),
(303, 'Tina Segers', 'tina.segers@hotmail.com', '0471021429', 'Hallo \r\n\r\nIk had graag wat meer informatie over het wijnarrangement voor 2 personen. Wat is de prijs? Wat zijn de mogelijke data, is het ook mogelijk op zondag? \r\n\r\nMet vriendelijke groeten\r\nTina Segers', '2015-11-23 14:51:34', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(304, 'Huybrechts', 'marc@obb62.be', '0499354434', 'Beste,\r\n\r\nkunnen wij as. zaterdag met 4 personen vanaf 20u. komen degusteren?\r\nAlvast bedankt voor uw reactie\r\n\r\nMarc', '2015-11-25 12:00:55', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(305, 'Eddy Cousin', 'eddy.cousin@kbcmail.net', '0495/59.82.42', 'Geachte heer Van Herck. Om misverstanden te vermijden, hierbij bevestiging van onze reservatie van 20 december 2015 om 19u voor 7 personen. Zoals afgesproken kunnen wij waardebonnen PERNAMBUI/257 en 259 (tot einde van dit jaar) aanwenden.\r\nWe kijken er al naar uit !\r\nEddy', '2015-11-25 23:31:26', 'http://www.colvenier.be/reserveer.htm'),
(306, 'susanne kemner', 'susanne.kemner@kemneroptics.nl', '+31623498195', 'hebben jullie 1e kerstdag een tafel vrij voor 11 personen?', '2015-11-26 09:28:31', 'http://www.colvenier.be/reserveer.htm'),
(307, 'LOUIS Paul', 'louis.neuro@gmail.com', '0475 34 79 29', ' 7 personen; 6 \"alles-eters\", 1 vegetarir( geen vlees en geen vis); kan de vegi  ook lekker reten en mee  volgen?', '2015-11-26 15:20:34', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=1660'),
(308, 'Hertogs', 'hertogs.vermeir@gmail.com', '0476254067', 'Beste,\r\n\r\nIs het restaurant geopend op 31/12? welk menu serveren jullie? prijs all-in?\r\n\r\ndank je\r\nIsis & Kurt Hertogs', '2015-11-26 17:38:31', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=1661');
