(309, 'hans cuykx Rotary Hoogstraten', 'hanscuykx@skynet.be', '0474 869374', 'geachte heer,\r\n\r\nbetreffende de optie reservering zaal 80 personen voor evenement Rotary hoogstraten op 5 maart 2016 dienen wij u tot onze spijt te melden dat dit dient geannuleerd te worden om organisatorische redenen. Graag uw bevestiging van annulatie. Excuses voor het ongemak.\r\n\r\nHoogachtend\r\n\r\nHans Cuykx', '2015-11-28 11:04:29', 'http://www.colvenier.be/reserveer.htm'),
(310, 'Maggy Schaap', 'maggyschaap@gmail.com', '0652607763', 'Beste,\r\n\r\nAankomend weekend zijn mijn vriend en ik in Antwerpen. We willen graag iets leuks doen en dachten aan een wijnproeverij. Wat zijn de mogelijkheden en prijzen bij jullie? Ik hoor het graag.\r\n\r\nMet vriendelijke groet,\r\n\r\nMaggy Schaap\r\n(NL)', '2015-11-30 14:13:29', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(311, 'Oksana', 'oksana.screve@telenet.be', '0495261967', 'Beste\r\n\r\nIs het mogelijk om bij jullie een feest te organiseren voor 50-60 personen met een dansgelegenheid (eigen DJ)? Zo ja, hoeveel zou dat dan kosten voor een all-in menu (aperitief, 1/2 fles wijn pp., water en koffie inbegrepen) + zaal?\r\n\r\nAlvast bedankt!\r\n\r\nMvg, Oksana Screve', '2015-11-30 19:18:39', 'http://www.colvenier.be/reserveer.htm'),
(312, 'Troubleyn', 'dominique_t_@hotmail.Com', '0475/499758', 'Beste,\r\n\r\nIk ben genteresseerd in het wijnarrangement voor 2 personen.\r\nWanneer kan je dit doen en wat is de prijs voor 2 personen?\r\n\r\nMet vriendelijke groeten,\r\nDominique Troubleyn', '2015-11-30 21:37:52', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(313, 'yvonne habraken', 'yhabraken@prinsen.nl', '+31-492-506197', 'Na het diner op 15 december a.s. (gereserveerd voor de PLG Group) heb ik een kamer/appartement gereserveerd voor de heer Wim van den Berg. Hij gaat helaas geen gebruik maken van de kamer. Kunt u mij een bevestiging sturen dat de reservering geannuleerd is? Met mijn hartelijke dank, Yvonne Habraken', '2015-12-01 10:21:05', 'http://www.colvenier.be/reserveer.htm'),
(314, 'A.H.A. Dohmen', 'ahad@kpnplanet.nl', '+31115613731', 'Is dineren mogelijk op 25 december vanaf rond 14.00 uur, en is er nog eventueel plaats voor 4 personen ?', '2015-12-02 21:13:19', 'http://www.colvenier.be/reserveer.htm'),
