(316, 'Jan-Timon van Dorp', 'jtvandorp@gmail.com', '+31630873685', 'Goedenavond, \r\n\r\nIk heb u zojuist gebeld over een reservering voor oudjaar, voor twee personen. Kunt u deze reservering ook aan mij bevestigen? \r\n\r\nMet vriendelijke groet, \r\nJan-Timon van Dorp ', '2015-12-10 20:36:27', 'http://www.colvenier.be/reserveer.htm'),
