(319, 'Lotte', 'lotte.adr@gmail.com', '0478402182', 'Beste,\r\n\r\nwat is de prijs van een wijndegustatie voor 2 personen?\r\nGelieve me bij voorkeur te contacteren via mail.\r\n\r\nAlvast bedankt,\r\n\r\nMvg,\r\n\r\nLotte', '2015-12-13 14:25:08', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(320, 'Karin Hellemans', 'karin.hellemans1@telenet.be', '0486148694', 'Beste,\r\nWat is de prijs van de wijndegustatie voor 2 personen ? \r\nOp welke dagen is dit mogelijk ? \r\nMoet er gereserveerd worden ?\r\nMogelijkheid tot kadobon ?\r\n\r\nBedankt voor de info.', '2015-12-13 19:30:02', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(321, 'Dirk Van Dessel', 'vandesseldirk54@gmail.com', '0475 74 94 21', 'Kan ik woensdag een cadeaubon komen afhalen ter waarde van 50 euro ?', '2015-12-14 22:09:38', 'http://www.colvenier.be/reserveer.htm'),
