(323, 'Leen Handschoewerker', 'leenhandschoewerker@msn.com', '0479240434', 'beste \r\n\r\nwij zijn op zoek naar een leuke gezellige wijnbar waar we vooral witte wijnen en champagnes kunnen proeven. we zijn met 4 personen. is het mogelijk om een offerte te laten maken? \r\n\r\nMvg Leen ', '2015-12-17 22:00:57', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(324, 'Eline Reynaers', 'eline_louisa_reynaers@hotmail.com', '06-30495764', 'Beste mijnheer/mevrouw, \r\n\r\nIk zou graag een wijnproeverij voor twee personen laten plaatsvinden op 2 januari 2016 in de middag. Ik hoor graag of dit mogelijk zou zijn. \r\n\r\nMet vriendelijke groet, \r\n\r\nEline Reynaers', '2015-12-18 13:33:44', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(325, 'Thomas Van de Pol', 'thomas_vandepol@hotmail.com', '0494244657', 'Beste, \r\n\r\nIk zou graag een cadeaubon geven voor een wijndegustatie voor 2 personen. Voor welke prijsklasses zouden jullie eventueel een arrangement kunnen samenstellen? \r\n\r\nMet vriendelijke groet , \r\nThomas Van de Pol', '2015-12-18 14:48:52', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(326, 'Tania Van Laer', 'vltania@hotmail.com', '0499144259', 'Beste,\r\n\r\nWij hebben vastgesteld dat jullie via the surprise factory ook cadeaubons verdelen. Is het ook mogelijk rechtstreeks bij jullie een cadeaubon te verkrijgen? \r\n\r\nAlvast bedankt voor de info.\r\n\r\nMvg\r\n\r\nTania Van Laer', '2015-12-18 18:49:53', 'http://www.colvenier.be/reserveer.htm'),
(327, 'Frauke de Waard', 'fraukedewaard@hotmail.com', '0494155733', 'Geachte\r\n\r\nZou het ook mogelijk zijn een degustatie te plannen met 3 personen? Zo ja, op hoeveel zou dat dan komen? \r\n\r\nMet vriendelijke groeten \r\nFrauke de Waard', '2015-12-20 18:41:25', 'http://www.wijnbar-antwerpen.be/contact.htm'),
