(331, 'Katrien Timmerman', 'katrien.timmerman@atlas-insurancecover.com', '0474910486', 'Beste, heb gezien dat er nog plaats is voor 10 pers op 22/01/2016.  probleem is echter dat wij 3 personen hebben die enkel vis eten.  Is het mogelijk menu aan te passen.  Ons budget is EUR 70 per persoon/incl wijn/water bij eten en eventueel aperitief', '2015-12-28 15:09:19', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=1819'),
