(333, 'Thomas Mattheussen', 'thomas.mattheussen@gmail.com', '/', 'Beste,\r\n\r\nIk ben voor 3 september 2016 nog op zoek naar een locatie om te dineren met een groep van ongeveer 24 personen, voor een trouwfeest. Ik ben zelf al enkele malen, komen eten bij Colvenier en was telkens zeer tevreden. Daarom vroeg ik mij af of jullie ook groepsformules aanbieden? Zoja, zou u me hier wat meer info over kunnen aanbieden?\r\n\r\nvr groeten,\r\n\r\nThomas', '2015-12-29 10:56:38', 'http://www.colvenier.be/reserveer.htm'),
(334, 'Lisa Boere', 'lisa.boere@hotmail.com', '0031622753309', 'Geachte heer/mevrouw,\r\n\r\nIk had voor vandaag 17.00 uur een wijnproeverij voor 2 personen gereserveerd, helaas moet ik dit afzeggen wegens ziekte. \r\nGraag bel ik u eind deze week voor een nieuwe afspraak.\r\n\r\nMet vriendelijke groet,\r\n\r\nLisa Boere', '2015-12-29 14:28:45', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(335, 'Jessica Van de vijver', 'jessica.vandevijver@4dvision.be', '0478546534', 'Geachte,\r\nIk zou graag een wijnproeverij met hapjes organiseren als verrassing voor een partner van 4D vision die 60 jaar wordt. Ik vroeg me af wat juist de mogelijkheden zijn. Het zou voor een 20-tal personen zijn, indien nog mogelijk op vrijdagavond 26 februari. \r\nAlvast bedankt voor de informatie.\r\nMet vriendelijke groeten,\r\nJessica Van de Vijver', '2016-01-04 10:04:50', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(336, 'van mol anita', 'anita_vm@hotmail.be', '0476397771', 'mogen er hondjes binnen ?? het is een jack russel van 15 jaar oud en ligt op mijn schoot ', '2016-01-09 11:36:12', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=1876'),
(337, 'herman vernooij', 'herman@triomftours.nl', '0031-646065378', 'Wij willen graag een reservering maken voor een groep van 28 personen op vrijdagavond 27 mei a.s.  om ca. 18.30 uur.\r\nKunt u ons z.s.m. laten weten of deze reservering mogelijk is?  Zo ja,  kunt u dan uw menu;s voor groepen aan ons toezenden??  \r\nReisbureau Triomf Tours  NL\r\ntel. 0031-343-591158\r\nfax 0031-343-591157\r\nherman@triomftours.nl', '2016-01-11 16:14:50', 'http://www.colvenier.be/reserveer.htm'),
(338, 'Van Mooy Coffee', 'info@vanmooycoffee.nl', '0031616337721', 'Beste,\r\n\r\nWij Van Mooy Coffee bieden vers gebrande 100 % Arabica koffiebonen. Onze koffiebonen worden bij bestelling gebrand, zodat de versheid van de bonen gegarandeerd wordt in tegenstelling tot andere koffieleveranciers die maanden van te voren hun koffiebonen branden.\r\n\r\nOnze koffiebonen zijn met liefde en zorg geplukt en geselecteerd. De koffieboeren kunnen ook eerlijk profiteren van ons groei en succes. Als koffieliefhebbers met passie voor kwalitatieve koffie zijn onze koffiebonen een goede aanvulling op uw aanbod. Als u genteresseerd bent dan willen wij graag wat samples aan u toe sturen om te proeven van onze koffiebonen.\r\n\r\nGraag hoor ik van u.\r\n\r\nMet vriendelijke groet,\r\n\r\nA.Rais\r\nwww.vanmooycoffee.nl', '2016-01-16 12:40:51', 'http://www.colvenier.be/reserveer.htm'),
(339, 'De Maere Anglique', 'angelique-dm@hotmail.com', '0477324564', 'Beste\r\n\r\nIk ben genteresseerd in het arrangement met de jonge streekwijnen.\r\nWij zijn met een groep van 7 personen. Ik wou vragen wat de prijs is en hoelang deze wijnproeverij duurt.\r\n\r\nVriendelijke groeten Anglique', '2016-01-17 11:26:54', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(340, 'Raquel Merkestein', 'raquelmerkestein@hotmail.com', '0434896114', 'Hallo,\r\n\r\nIk heb een vraagje over het wijnarrangement voor 2 personen. Wat voor prijs kan ik verwachten bij dit arrangement?\r\n\r\nDaarnaast ben ik benieuwd of ik nog een reservering kan maken voor het wijnarrangement voor 2, op 14 februari. Is dat nog mogelijk of is het volgeboekt?\r\n\r\nIk hoor graag van u,\r\n\r\nMet vriendelijke groet,\r\nRaquel Merkestein', '2016-01-21 16:37:22', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(341, 'vogelaers walter', 'vogelaers.walter@skynet.be', '0495183881', 'beste ik had een reservatie op 26/01 voor 4 personen om 19.30 kan deze verzet worden naar 02/02/2016 zelfde uur zelfde aantal', '2016-01-22 15:13:06', 'http://www.colvenier.be/reserveer.htm'),
