(343, 'Tine', 'tine_vo@hotmail.com', '0474 52 51 54', 'Beste,\r\nKlopt het dat jullie ook de wijnkelder verhuren voor feesten?\r\nIs het mogelijk om daar wat meer informatie over door te geven aub.\r\nAantal personen, formules, muziek..\r\nAlvast bedankt.', '2016-01-28 13:10:45', 'http://www.colvenier.be/reserveer.htm'),
