(345, 'Nadia Jordaens', 'nadia.jordaens@telenet.be', '0477/32.33.07', 'Beste, \r\nIk organiseer de teambuilding voor het zaalpersoneel van het crowne plaza te antwerpen en u zaak trok erg mijn aandacht. De datum van ons uitje is vrijdag 26 februari, vanaf 18.30uur. Wij zullen met een 12 personen zijn. We hebben echter een budget voor het eten van 30 euro per persoon, kan u voor ons iets betekenen? We hebben een gezelschap met verschillende culturen, dus zou het goed zijn dat er een keuze tussen vis en vlees zou zijn.\r\ndank bij voorbaat,\r\nnadia', '2016-02-01 23:11:18', 'http://www.colvenier.be/reserveer.htm'),
(346, 'Laurent Lambrechts', 'laurent.lambrechts@telenet.be', '0479283469', 'Beste,\r\nserveren jullie nu vrijdag nog steeds de wildmenu? \r\n\r\nMvg,\r\nLaurent', '2016-02-02 13:04:42', 'http://www.colvenier.be/reserveer.htm'),
(347, 'katleen vereecke', 'info@vereecke-chocolaterie.be', '0477263329', 'Beste Mijnheer,\r\nvorige week hebben mijn dochter kunnen genieten van een goed diner in een mooi kader,\r\nwe kwamen aande praat en ik vertelde over onze chocolaterie,\r\nik zend zo spoedig mogelijk een pakje op dan kunt u deze proeven,\r\nkwas een week afwezig daarom deze late reactie,\r\nik bezocht ook de chocolaterien tijdens mijn verblijf in antwerpen,\r\ndie prijzen zijn zoals u zei niet te betalen,\r\nonze chocolade is de pure callebaut,\r\nprijs kwaliteit zitten wij zeer goed,\r\nkzou zeggen laat het u smaken\r\ngroeten\r\nkatleen vereecke \r\n', '2016-02-09 11:10:38', 'http://www.colvenier.be/reserveer.htm'),
(348, 'Laura Geens', 'geens.laura@hotmail.com', '0491438154', 'Beste,\r\n\r\nHoeveel kost een wijnarrangement voor 10 personen?\r\n\r\nMet vriendelijke groeten,\r\n\r\nLaura Geens', '2016-02-09 13:16:40', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(349, 'De Backer Eric', 'egr.debacker@gmail.com', '0477444777', 'Is er nog plaats voor 2 personen op 14/2/2016 om 12u?\r\nHebt u een Valentijnsmenu?\r\nVr. gr.', '2016-02-09 17:26:26', 'http://www.colvenier.be/reserveer.htm'),
(350, 'leen', 'hendrikx.leen1991@gmail.com', '0496/870289', 'beste,\r\n\r\nzou u mij een prijs kunnen geven voor een degustatie voor 10personen (ongeveer 6wijnen) zondag 15mei in de namiddag.\r\n\r\nmvg hendrikx leen', '2016-02-10 12:51:57', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(351, 'Lucie de Wever', 'luciedewever@hotmail.com', '0485312852', 'Ik las op jullie website dat jullie wijnarrangementen aanbieden voor 2 personen. Ik vroeg me echter af hoeveel deze kosten per persoon. Is het ook mogelijk om bij jullie cadeaubonnen aan te schaffen waarmee degenen die ze krijgt zelf kunnen kiezen of ze een wijnarrangement doen of wijn kopen of gewoon wijn komen drinken?', '2016-02-10 12:56:43', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(352, 'Linse Gheys', 'linsegheys@hotmail.com', '0477481047', 'Beste, \r\n\r\nIk vroeg me af of u misschien wat meer info kon geven over het wijnarrangement voor 2 personen. Wat is de prijs hiervan en is het eventueel mogelijk om dit met 3 personen te doen? \r\n\r\nAlvast bedankt!\r\nMet vriendelijke groeten,\r\n\r\nLinse Gheys', '2016-02-10 17:47:01', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(353, 'Hubert Hendrix', 'hubert.hendrix@exxonmobil.com', '0499948158', 'Hello,\r\nGraag had ik een offerte gekregen voor een diner op 17 maart met 18 personen. Budget max 75 euros BTW incl. Met apperitief, diner met wijn, koffie. Dank U bij voorbaat.', '2016-02-11 10:17:20', 'http://www.colvenier.be/reserveer.htm'),
(354, 'Buy MapleStory Mesos', 'lwuwyncbyfr@gmail.com', 'http://www.luvx', 'You always love it.\r\n[url=http://www.luvxtra.com/member/blog_post_view.php?postId=22507]Buy MapleStory Mesos[/url]', '2016-02-11 17:19:07', 'http://www.colvenier.be/reserveer.htm'),
(355, 'dejosse fernand', 'fdejosse@telenet.be', '0475469977', 'Een gezelschap van ongeveer 25 personen.\r\nwanneer 8 mei avond. zondag.\r\nvoorbeeld en\r\nprijs 3 of 4 gangen menu, aperitief en wijnen. inbegrepen.\r\nWat kost een eventuele overnachting?', '2016-02-13 11:19:53', 'http://www.colvenier.be/reserveer.htm'),
(356, 'Miranda Willems', 'miranda.willems@eu.averydennison.com', '+32496156798', 'Beste,\r\nWij zijn op zoek naar een locatie voor een dinner met ons leadership team vergezeld van de partners voor zaterdag 12 maart. \r\nWij verwachten in totaal een 20 a 24 aanwezigen.\r\nWe denken aan een aperitief in de kelder, met aansluitend een 4-gangen dinner. \r\nGraag hoor ik of jullie nog beschikbaarheid hebben voor onze groep, en ontvang ik een voorstel voor het 4-gangen menu.\r\nMvg,\r\nMiranda Willems', '2016-02-15 16:01:49', 'http://www.colvenier.be/reserveer.htm'),
(357, 'aukje', 'aukje_lansman_123@hotmail.com', '-', 'Hallo,\r\nIk heb interesse in een wijnproeverij voor 2 personen. Kunt u mij meer informatie geven over prijzen en data.\r\nmet vriendelijke groet\r\nAukje Lansman', '2016-02-16 11:45:02', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(358, 'nathalie', 'nathalie.beyens@zorg-en-gezondheid.be', '02/5502308', 'Hebben jullie plaats om een 50-tal personen te laten lunchen, eventueel in een plaats apart? Jullie vermelden op de website ook een parking in de Schoytestraat 6, Is dit een private parking van jullie restaurant? Kan deze eventueel gereserveerd worden?\r\nAlvast bedankt voor uw antwoord.', '2016-02-17 09:21:39', 'http://www.colvenier.be/reserveer.htm'),
(359, 'Gaby Van Erk', 'vanerk.gaby@skynet.be', '0498802592', 'Nu zie ik hiernaast dat het maandag gesloten is, is dat zo ?', '2016-02-20 21:56:06', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=2039'),
(360, 'Emelien Sharma', 'e.m.sharma@hotmail.com', '0630605658', 'Graag zou ik willen weten hoeveel het wijnarragement kost voor 3 personen?\r\nOok of dat mogelijk is aangezien er alleen een wijnarragement voor 2 personen staat.\r\nWij komen morgen een dagje naar Antwerpen.\r\nGroetjes,', '2016-02-23 14:50:28', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(361, 'Vera van den Broek', 'verabroek@msn.com', '0630242613', 'Hallo,\r\n\r\nMijn vriend is sommelier in Nijmegen, voor zijn verjaardag wil ik graag een wijn arrangement voor twee personen geven. Wat zijn de kosten van dit arrangement en hoe ver van tevoren moet dit gereserveerd worden?\r\n\r\nVriendelijke Groeten,\r\nVera van den Broek', '2016-02-23 20:04:16', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(362, 'Naqhie Vertriest', 'naqhie@hotmail.com', '0478214219', 'Goeie morgen,\r\n\r\nIndien mogelijk zou ik graag eens een prijs offerte krijgen ivm jullie wijndegustatie pakketten die jullie aanbieden?\r\n\r\nHet zou voor een mogelijke optie zijn rond de 10personen?\r\n\r\nMet vriendelijke groeten\r\nNaqhie Vertriest', '2016-02-24 06:37:46', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(363, 'E.Boone', 'erwin.boone34@gmail.com', '0498867454', 'Beste,\r\n\r\nKunnen wij gewoon langskomen om een paar wijntjes te proeven (per glas) ? Ttz is er een wijnbar om diverse wijnen te proeven of kan dit enkel bij reservatie ? Zo ja, kan dit voor 2 personen en wat is de prijs hiervoor ,\r\nAlvast bedankt voor de info.\r\nMvg,\r\nE.Boone', '2016-02-24 13:14:31', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(364, 'Ann Hellemans', 'anneke_nr_1@hotmail.com', '0473805287', 'Beste,\r\nik had graag een vriendin een bon cadeau gedaan voor een wijnarrangement voor twee personen. Kan ik hiervan een cadeaubon kopen? En zoja hoeveel kost dat?\r\nM.v.g.\r\nAnn Hellemans', '2016-02-24 17:30:09', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(365, 'melort christiana', 'pauwelsmelort@gmail.com', '0487 494 246', 'mogen we vragen of er al een datum is voor het jaarlijks verlof ? vriendelijke groet CH.Melort', '2016-02-26 10:17:19', 'http://www.colvenier.be/reserveer.htm'),
(366, 'simon scholten', 'simonscholten111@gmail.com', '+31611006002', 'Beste,\r\n\r\nwij zijn met een groep van 5 en zouden een unieke wijnproeverij willen ervaren.\r\nter afsluiting wellicht met een hapje eten inclusief bijpassend wijnarrangement.\r\nis het mogelijk om dit te kunnen reserveren bij jullie.\r\ngraag zouden wij dit willen doen op zaterdag 28 mei.\r\n\r\nik verneem graag van u.\r\n\r\nmvg, \r\n\r\nSimon Scholten', '2016-02-26 16:56:22', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(367, 'ellen jennes', 'ellen_jennes@hotmail.com', '0473491237', 'Beste,\r\nOp 11 juni doen wij een vrijgezellenweekend voor een vriendin en zouden we graag wat wijnen proeven gezien zij dit zeer graag drinkt.\r\nZou het op deze moment eventueel mogelijk zijn voor 16 man? ', '2016-03-01 19:38:51', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(368, 'Benian Karaca', 'beniankaraca@outlook.com', '0476223317', 'Beste, \r\n\r\nIk zou graag met een aantal vrienden een kaas en wijn proeverij willen houden voor een verjaardagsfeestje. \r\n\r\nNa even zoeken op het internet ben ik bij jou terecht geraakt en zit met een aantal vragen:\r\n\r\n-Hoeveel personen mogen er maximum aanwezig zijn?\r\n-Wat zijn de suggesties/combineerbare suggesties?-De prijzen?\r\n\r\nAlvast bedankt, \r\nBenian Karaca', '2016-03-01 22:50:43', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(369, 'Cindy Dekoning', 'cdekoning@kpmg.com', '038211736', 'Beste,\r\n\r\nvoor een teambuilding zou ik graag weten wat de prijs is voor een groep van 15 tot maximaal 20 personen voor de verschillende arrangementformules.\r\n\r\nMet vriendelijke groet,\r\n\r\nCindy Dekoning ', '2016-03-04 08:25:01', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(370, 'Stefanie Caenen', 'stefanie.caenen@gmail.com', '0472242766', 'Beste,\r\n\r\nZou het nog mogelijk zijn om een wijndegustatie voor 2 personen te reserveren voor morgenavond?\r\n\r\nAlvast bedankt\r\nVriendelijke groeten\r\nStefanie Caenen', '2016-03-04 09:52:45', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(371, 'Alanis Campo', 'nissi23.07@hotmail.com', '0477/731.327 ', 'Beste, \r\n\r\nGraag had ik wat meer info gehad over jullie wijnproeverijen. Ik zou het cadeau willen doen aan een 21 jarige jongeman. \r\n\r\nWat is jullie kostprijs? \r\nHoelang duurt het? \r\nWanneer kan ik een reservatie maken? \r\n\r\nAlvast bedankt! ', '2016-03-07 11:43:24', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(372, 'Asmait Tesfay', 'asmait.tesfay@gmail.com', '0616385332', 'Beste L.S.\r\n\r\nOp zaterdag 18 juni willen wij graag een wijnproeverij bij jullie afnemen. Onze vraag is of jullie een wijnproeverij doen voor ongv 20 personen. Zoja, wat is de prijs voor een 6 of 8 wijnarragement?\r\nKunt u voor ons een offerte maken?\r\n\r\nMet vriendelijke groet,\r\n\r\nAsmait Tesfay', '2016-03-07 21:26:00', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(373, 'no.1 fifa 16 coins android seller', 'qykzpdosmpv@gmail.com', 'http://www.fifa', 'Too bad we have to return them .', '2016-03-08 01:39:47', 'http://www.colvenier.be/indexen/book-online.htm'),
(374, 'Romy Rijkeboer', 'romyrijkeboer@hotmail.com', '0623672815', 'Goedemiddag,\r\n\r\nWij zijn van plan om met een groep van ongeveer 15 personen naar Antwerpen te komen. Hebben jullie voor mij een prijzenlijst bij de verschillende arrangementen? Dan kunnen we kijken wat we willen doen.\r\n\r\nVriendelijke groeten,\r\nRomy Rijkeboer', '2016-03-08 12:09:44', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(375, 'Sofia van Santen', 'sofiavansanten@gmail.com', '0491955171', 'Beste,\r\nIk zou graag met 2 personen een proeverij doen. Wat is hiervan de prijs? We kunnen ook bij een andere groep aansluiten. Is dit soms mogelijk? \r\nZou het mogelijk zijn zaterdag 12 maart nog iets te reserveren?\r\n\r\nAlvast bedankt.\r\ngroeten Sofia van Santen', '2016-03-09 17:00:41', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(376, 'fran asselberghs', 'fran.asselberghs@numericable.be', '0477232862', 'beste,\r\nwe hebben elkaar telefonisch gesproken. Op zaterdag 19 maart zouden wij met een groep van 18 personen om 17u in uw wijnbar een aperitief komen drinken. Ons budget is 15/persoon. Graag hadden wij daarvoor 2 glaasjes gedronken (1 bubbels en 1 witte wijn bv) en een klein hapje gegeten (vegetarisch). Om 18u45 vertrekken wij opnieuw. Kan u ons een voorstel doen aub? \r\nHartelijk dank,\r\nFran Asselberghs', '2016-03-10 10:06:27', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(377, 'jeannine Weyers', 'jweyers@telenet.be', '0486 95 15 52', 'beste,\r\nik zou mijn familie , ( 7 personen) voor een etentje uitnodigen: ik stel hen 3 data voor dinsdag 10 mei, vrijdagen 13 of 20 mei.\r\nKunnen wij dan bij U terecht vanaf 13u30 voor een 3-gangen menu zonder aperitief?', '2016-03-13 12:36:38', 'http://www.colvenier.be/reserveer.htm'),
(378, 'Lisa Vermeyen', 'lisavermeyen@hotmail.com', '0487641419', 'Beste,\r\nIk wou me graag informeren over de wijn proeverij voor 2personen. \r\nKrijgen wij een woordje uitleg bij de wijnen of is het enkel proeven?\r\nHoeveel betaal je voor een avond per persoon?\r\nVriendelijk bedankt.\r\nGroetjes Lisa', '2016-03-14 10:50:53', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(379, 'Katrien De Geyter', 'katrien.de.geyter@gmail.com', '0471/04.05.21', 'Hallo, ik heb interesse in de wijndegustatie voor 2 personen. Moeten we hier op voorhand voor reserveren? Zo ja hoelang op voorhand? Zijn hier ook cadeaubonnen voor te verkrijgen? Wat is de kostprijs? Alvast bedankt voor de info. Mvg Katrien De Geyter', '2016-03-14 14:55:59', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(380, 'Embrechts Denise(Pheadra Nijlen BVBA)', 'folies@pheadra.be', '0475/935579', 'Goede middag Patrick,\r\nWij hebben voor vanavond een reservatie voor 6 personen Wij hebben reeds een keuze gemaakt en gaan voor de 4 gangen menu Vermits er 2 mensen bij zijn die niet goed de trappen kunnen doen willen wij graag het apperitief boven gebruiken kan dat?en vermits het een tractatie betreft voor het personeel zou ik ook geen prijskaart aan tafel willen Ik weet dat we bij u in goede handen zijn Tot vanavond.\r\nDenise Embrechts', '2016-03-15 15:30:10', 'http://www.colvenier.be/reserveer.htm'),
(381, 'Marleen van Sleeuwen', 'marleenvansleeuwen@hotmail.com', '0634549602', 'Hallo, \r\n\r\nGraag wilde ik de prijs opvragen voor als wij met 6 personen een wijnproeverij willen houden. De dag dat wij hem willen plannen is op vrijdag 10 juni, heb je nog plek rond 20:00 uur?\r\n\r\nGroetjes, \r\nMarleen', '2016-03-16 20:20:46', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(382, 'Lilian de Ruijter', 'lilianderuijter@gmail.com', '0622739874', 'goedemiddag heer, mevrouw, \r\n\r\nIk heb voor morgenavond een tafel gereserveerd voor 2 personen, helaas ben ik genoodzaakt om deze af te zeggen. Het spijt mij ontzettend. \r\n\r\nVriendelijke groeten,\r\n\r\nLilian de Ruijter ', '2016-03-17 12:56:53', 'http://www.colvenier.be/reserveer.htm'),
(383, 'Meral Bikhan', 'meralbikhan@hotmail.com', '0483473026', 'Beste,\r\n\r\nIk zou graag wat meer informatie willen verkrijgen over het wijnarrangement voor 2 personen. \r\n\r\nWat is de prijs van dit arrangement? \r\nZou dit ook gaan op een dinsdagavond na 20u? \r\n\r\nAlvast bedankt,\r\n\r\nMet vriendelijke groeten,\r\n\r\nMeral Bikhan ', '2016-03-17 14:19:27', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(384, 'Pascal Stoop', 'pascal.st00p@hotmail.com', '0486 306 373', 'Beste, \r\nik heb een reservatie gemaakt voor zondag 20 maart 19:30 uur, ik zie nu echter dat jullie restaurant normaal gesloten is op zondag, mijn vraag is dus of ik een geldige resrvatie heb gemaakt of niet?\r\nMet vriendelijke groeten\r\nPascal', '2016-03-18 11:12:07', 'http://www.colvenier.be/reserveer.htm'),
(385, 'Hanne Herbots', 'hanneherbots@hotmail.com', '0495783738', 'Beste\r\n\r\nVoor de verjaardag van mijn vriend zou ik hem graag een wijndegustatie cadeau doen. Ik wou graag informeren naar de kostprijs van een wijnarrangement voor 2 personen?\r\n\r\nMvg', '2016-03-21 22:46:00', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(386, 'Steven Bertels', 'steven.kristel@skynet.be', '0471367107', 'Hallo,\r\n\r\nGraag had ik geweten of het mogelijk is om voor 4 personen een wijndegustatie te houden en wat de kostprijs zou zijn.\r\n\r\nHet liefst zouden we dit op een zaterdagavond of zondagnamiddag doen.\r\n\r\nAlvast bedankt voor de informatie.', '2016-03-22 20:08:42', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(387, 'Leen Vloemans', 'malt.sales@boortmalt.com', '03/545.04.72', 'Beste,\r\nEnkele weken geleden hadden we telefonisch contact ivm een klantendiner op 9/6/2016. Vermits er klanten van AB inbev meekomen, hadden we graag ook deze bieren geschonken. Dat was geen probleem. Volgens de info die u toen gaf, is een 3-gangen menu 45 excl dranken. Is het mogelijk on een menu voorstel te doen?\r\nAlvast bedankt,\r\nLeen Vloemans\r\nSales assistant', '2016-03-30 09:52:47', 'http://www.colvenier.be/reserveer.htm'),
(388, 'Louisa Ververs', 'louisa.ververs@sompocanopius.com', '00447774742688', 'Hallo,\r\nOp zaterdag 7 mei zijn wij met een groep van 10 personen in Antwerpen voor een vrijgezellenfeestje en ik dacht dat misschien een champagne of wijn proeverij een goed begin van de avond was. Ik zag dat u verschillende pakketen op de website had staan, maar zag geen prijzen. Ook vroeg ik me af of u een speciale champagne proeverij heeft (de bruid is dol op bubbels namelijk!).\r\nVriendelijke groet,\r\nLouisa', '2016-04-06 11:54:13', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(389, 'Chantal Borsj ', 'chantalborsje@hotmail.com', '0031-618650236', 'Geachte heer/mevrouw,\r\nGraag zou ik informatie ontvangen over een wijnproeverij voor 10 personen voor 6 wijnen. Wat is de duur van de proeverij qua tijd en wat zijn de kosten? Ik hoor het graag!', '2016-04-06 13:35:02', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(390, 'Dennis Xhat', 'dennisxh@icloud.com', '0477469138', 'Beste,\r\n\r\nAls ik met mijn vriendin een wijnproeverij wil doen, hoe kan dit geregeld worden? En hoe ver op voorhand moet dit vastgelegd worden?\r\n\r\nMvg,\r\n\r\nDennis Xhat', '2016-04-07 13:59:42', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(391, 'Marjolijn Verschuur', 'maryo_lol@hotmail.com', '06-83085621', 'Dag,\r\n\r\nIk vroeg me af of het wijn arrangement voor twee personen ook te boeken is voor vier personen? En hoe veel het per persoon kost?\r\n\r\nMvg,\r\nMarjolijn Verschuur', '2016-04-07 19:01:17', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(392, 'David Titeca', 'david.titeca@formatplus.be', '0474 31 56 17', 'Naar aanleiding van ons telefonisch gesprek, stuur ik u hierbij wat meer informatie betreffende mijn aanvraag voor een Champagne tasting.\r\n- Locatie : KAS (linkeroever)\r\n- Datum : 23/04/16\r\n- Timing : 10.15-11.30\r\n- 6 pers (vrouwen van aanwezige journalisten, 4 NL & 2 FR)\r\n\r\nKan u mij op basis van bovenstaande een voorstel bezorgen ?\r\nEen alternatieve wijntasting mag ook voorgesteld worden.\r\n\r\nMocht u vragen hebben, aarzel dan zeker niet mij te contacteren.\r\n\r\nVriendelijke groeten\r\n\r\nDavid', '2016-04-08 11:09:48', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(393, 'Lotte Ditzel', 'mail@lotteditzel.com', '+31642249989', 'Hi, \r\n\r\nWat kost de wijnproeverij voor 2 personen?\r\n\r\nVriendelijke groet,\r\nLotte', '2016-04-10 12:16:34', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(394, 'Guy Coenen', 'coenenguy@hotmail.com', '+32477494484', 'Geachte chef, Mr Van Herck\r\nWij zijn zaterdag bij U geweest en ik wil u en uw personeel bedanken voor de excelente avond. Toch zou ik U op een aantal puntjes willen attent maken. Bij het apereitief waren er 2 gin tonic. Ik vindt voor uw niveau van zaak mag het merk van de gin gegeven worden en vindt ik dat het etiket van de tonic naar de klient moet gedraaid worden. Ik was uitgenodigd dus ik ken en wil de prijzen niet weten maar voor mij een formile wijn met 5 gerechten mag iets meer zijn dan 2 soorten wijn. Ik hoop dat dit comentaar niet slecht genomen wordt en dit kan toedragen tot een nog betere service en avond hetgene al heel moeilijk is.\r\n\r\nMet vermeende groeten.\r\n\r\nGuy Coenen', '2016-04-11 17:43:46', 'http://www.colvenier.be/reserveer.htm'),
(395, 'Amber-rose Oor en Debora Leensvaart', 'Amber-rose1991@hotmail.nl', '0651205272', 'Goede avond meneer/mevrouw,\r\n\r\nWij hebben intresse in de wijnproeverij arragement voor 2 personen.\r\nOnze vraag is of dit  mogelijk is op een zaterdagavond rond half 9? en wat zijn de kosten ervan?\r\n\r\nWij horen graag van u.\r\n\r\nMet vriendelijke groet,\r\n\r\nAmber-rose en Debora', '2016-04-12 21:07:22', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(396, 'Evelyn Smet', 'smet.evelyn@gmail.com', '0479472828', 'Hallo,\r\n\r\nIk zou graag weten hoeveel een wijnproefavond voor 2 personen kost. Mijn vader is namelijk jarig en ik vond dit wel een fijn cadeautje.\r\n\r\nGroetjes', '2016-04-20 15:49:13', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(397, 'Dahm, Martina', 'mdahm@portofkiel.com', '+491622444249', 'Bitte meine Reservierung am 24.05.2016 ergnzen um 13.00 Uhr ', '2016-04-20 17:10:55', 'http://www.colvenier.be/indexde/buchen-sie-online.htm'),
(398, 'Matthew Houthooft', 'matthew@iteg.be', '+32476033024', 'Beste,\r\n\r\nWat is de kostprijs voor het wijnarrangement voor 2 personen ?\r\n\r\n\r\nMvg,\r\n\r\nMatthew Houthooft', '2016-04-22 16:43:02', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(399, 'Kenny Hermans', 'kenny.hermans@portofantwerp.com', '0489692660', 'Beste,\r\n\r\nVrijdag ben ik 6 maanden samen met mijn vriendin. Beide houden we zeer veel van wijn. Ik zou haar dan ook graag verrassen met een wijnproeverij. Is dit mogelijk? Op vrijdag 29/4? Mvg, Kenny Hermans', '2016-04-25 11:30:01', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(400, 'Sonja', 'sonjamusters@yahoo.com', '0485367431', 'Beste, op 28 mei organiseer in een vrijgezellenfeestje voor mijn trouwende vriendin. Gezien haar liefde voor wijn leek een degustatie met de dames me iets heel leuks voor haar (en ons). Is zoiets ook mogelijk bij jullie? We zijn geen van allen experts, dus echte exclusieve wijnen zouden wat verspild zijn aan ons vrees ik, maar is het mogelijk om voor een groep van 10-15 mensen iets samen te tellen? En zo ja, kunt u een indicatie van de kosten geven? Vriendelijke groeten,\r\nSonja', '2016-05-01 22:38:34', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(401, 'Yves De Lannoy', 'yvesdelannoy@belgacom.net', '0495893061', 'Beste, we hebben een reservatie voor 2 voor donderdag. Moet een 3-gangen menu op voorhand worden gereserveerd ? Dank & vriendelijke groet, Yves De Lannoy', '2016-05-02 18:20:30', 'http://www.colvenier.be/reserveer.htm'),
(402, 'Chris Andries', 'chris.andries@telenet.be', '0474206434', 'Geachte,\r\nIs de wijndegustatie met bijhorende gerechtjes in de wijnkelder nog steeds van toepassing ?', '2016-05-03 11:31:47', 'http://www.colvenier.be/reserveer.htm'),
(403, 'Mika Lnnbro Fukino', 'mika.fukino@gmail.com', '04491969258', 'Hi! How much does the wine tasting cost for two persons? Are there spots available on May 21? ', '2016-05-10 16:44:36', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(404, 'Carolia Dierckx', 'carolia.dierckx@hotmail.com', '0471371146', 'Beste,\r\nIk had zeer veel interesse in jullie wijnbar. Wat is de exacte prijs hiervoor voor 2 personen?\r\nAlvast bedankt, \r\nCarolia Dierckx ', '2016-05-11 00:46:44', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(405, 'Maud de Vries', 'mauddevries@msn.com', '+31622887658', 'Beste WineBar Colvenier,\r\n\r\nEen goede vriendin van mij is pas jarig geweest en beide zijn wij dol op lekkere wijnen. Het leek me daarom leuk om een wijnproeverij voor 2 personen te doen. Aangezien ik nog een student ben is het voor mij wel even belangrijk te weten wat een wijnproeverij per persoon kost.\r\n\r\nIk hoor graag van u.\r\n\r\nMet vriendelijke groet,\r\n\r\nMaud de Vries', '2016-05-18 21:47:01', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(406, 'Cheap Chrome Hearts Clothing', 'ckuxppucl@gmail.com', 'http://www.chro', 'Wow, awesome blog format! How lengthy have you ever been running a blog for? you make blogging glance easy. The overall glance of your web site is great, let alone the content material!', '2016-05-20 12:16:57', 'http://www.colvenier.be/indexen/book-online.htm'),
(407, 'EventsFactory', 'info@eventsfactory.be', '0478282783', 'Beste,\r\n\r\nVoor een klant ben ik op zoek naar een locatie voor september 2017.\r\n\r\nHet idee is een tweejaarlijkse bijeenkomst die vorig jaar is doorgegaan in het Stadhuis in Antwerpen (waar wij toen toen het pop-up cafe hadden).\r\n\r\nZe zoeken steeds naar een unieke locatie of een tof uitzicht of  en zo kom ik bij jullie terecht.\r\n\r\nWe moeten, aangezien het om een vereniging gaat een sluitend voorstel doen voor 100 euro incl btw, maar hierin moet ook nog een marge voor ons zitten en we moeten nog een muzikaal intermezzo voorzien.\r\n\r\nDat laatste is geen kost, want hiervoor werken we samen met de opera en de muziekacademie Antwerpen, en wij zouden graag een marge van 10 % overhouden voor alle voorbereidingen, de facturatie, het begeleiden de avond zelf en de locatiezoektocht.\r\n\r\nDaarom mijn vraag, zou u even kunnen kijken of u een voorstel voor 90 euro inclusief btw kunnen opmaken voor een groep van 60 personen in september volgend jaar.\r\n\r\nVorig jaar hadden ze een (staand) aperitiefje met een paar hapjes tussen 18u en 19u, en aansluitend een zittend diner met enkele muzikale intermezzos tot 22u om af te sluiten met een koffietje met mignardises terug staand.\r\n\r\nAlvast bedankt om te bekijken wat er mogelijk is bij jullie.\r\n\r\nGroetjes\r\nDavy', '2016-05-20 16:44:53', 'http://www.colvenier.be/reserveer.htm'),
(408, 'Cecile Mestrini', 'cecilemestrini@gmail.com', '+31650240399', 'Goedemiddag,\r\n\r\nWij zouden graag een wijnproeverij doen op zondag 12 juni rond 14.30. Is dit mogelijk? We zijn met 6 personen. Wat zijn de kosten? We horen graag van u. \r\n\r\nVriendelijke groeten,\r\nCecile', '2016-05-23 14:00:03', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(409, 'Lies Van Pelt', 'liesvanpelt@hotmail.com', '0499801662', 'Hallo\r\nIs het mogelijk om een bon voor iemand te kopen bij jullie? Is er een minimum bedrag?\r\nGroetjes\r\nLies\r\n', '2016-05-26 07:54:34', 'http://www.colvenier.be/reserveer.htm'),
(410, 'Tim Buts', 'tim.buts@gmail.com', '0477690131', 'Beste,\r\n\r\nIk heb de eer om als getuige voor het huwelijk van mijn beste vriend, ook zijn vrijgezellendag in te delen.\r\n\r\nAls een wijn enthousiast, lijkt het ons een unieke beleving om voor hem een bezoek te regelen aan een wijnbar/kelder.\r\n\r\nBestaat er een mogelijkheid om met een groep van +/- 15 personen, een bezoek in te plannen op zaterdag 11 juni.\r\n\r\nKan u meedelen wat de mogelijkheden zijn op zaterdag voormiddag en namiddag en welke formules jullie eventueel aanbieden?\r\n\r\nAlvast bedankt voor uw feedback.\r\n\r\nMet vriendelijke groet,\r\n\r\nTim Buts\r\n\r\n ', '2016-05-26 09:43:37', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(411, 'Floor de Raad', 'floorderaad@outlook.com', '+31652848450', 'Geachte heer, mevrouw,\r\n\r\nOndanks uw uitgebreide informatie op uw site kan ik geen prijzen vinden voor de diverse wijnproeverijen. Wij zullen met een groep van +-15 personen zijn op 2 juni, ik zou graag willen weten wat een proeverij kost voor een proeverij met hapjes en een uitleg. Dit hoeven niet uw meest exclusieve wijnen te zijn.\r\n\r\nMet vriendelijke groet\r\nFloor de Raad', '2016-05-30 15:05:56', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(412, 'vercammen w', 'I.D88@telenet.be', '0476 93 66 19', 'Onze reservatie  voor 4 personen \r\nop 11juni  tegen 13 uur ', '2016-05-30 22:01:09', 'http://www.colvenier.be/reserveer.htm'),
(413, 'Deferme', 'evadeferme@hotmail.com', '0472222005', 'Beste, \r\nWij zijn opzoek naar een leuke activiteit voor een vriendin die 30 jaar zal worden op zaterdag 25 juni.\r\nAangezien ze wel wat gezonde interesse heeft in wijnen, lijkt me dit wel leuk.\r\nWe zouden met 5 personen aanwezig zijn. Liefst in de namiddag. Op hoeveel komt dit per persoon ? \r\n\r\nAlvast bedankt voor de info.\r\n\r\nEva Deferme ', '2016-05-31 15:51:56', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(414, 'Nathalie Prinsier', 'prinsiernathalie@gmail.com', '0496430013', 'Beste,\r\nIk had graag geweten hoeveel een wijnarrangement voor 2 personen kost en of ik dit ook in de vorm van een cadeaubon kan kopen (om te schenken aan een bevriend koppel).\r\nAlvast bedankt voor uw antwoord. \r\nMet vriendelijke groeten,\r\nNathalie Prinsier', '2016-06-03 09:30:22', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(415, 'Stefan Cornelis', 'cornelis.st@hotail.be', '0475892295', 'Beste,\r\n9 juli hebben wij ons huwelijk en zouden wij graag met onze kleine groep gasten bij jullie dineren. Het is een groep van 10 mensen. Graag hadden wij u hierover gesproken als de datum, 9 juli, nog beschikbaar is. \r\nMet vriendelijke groeten\r\n\r\nCornelis Stefan & Ganna Dyulger', '2016-06-05 17:56:59', 'http://www.colvenier.be/reserveer.htm'),
(416, 'Isa', 'isaappel@hotmail.com', '0487382923', 'Beste,\r\n\r\nGraag wil ik de prijzen weten voor het wijn-proef arrangement voor 2 personen. Ik zou dit cadeau willen doen.\r\n\r\nVriendelijke groet,\r\nIsa Appel.', '2016-06-08 11:41:55', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(417, 'Daniel Beerens', 'beerens@me.com', '+2977318690', 'Beste,\r\n\r\n\r\nIk wil graag met mijn vrouw een wijntasting doen. Wat is de mogelijkheid?', '2016-06-10 23:58:06', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(418, 'Cheap Beats By Dre', 'qmtznsx@gmail.com', 'http://qparentc', 'this is great', '2016-06-13 16:56:37', 'http://www.colvenier.be/indexen/book-online.htm'),
(419, 'dries mattheus', 'driesmattheus@hotmail.com', '0499418426', 'Beste,\r\n\r\nWij hebben op 23 juli een vrijgezellen feest. De persoon in kwestie is een fervent wijnliefhebber en we dachten om de dag in schoonheid af te sluiten een wijn proef sessie te boeken. Nu is de vraag of jullie zo iets organiseren?\r\nWe zouden rond 17.00u - 17.30u dit gebeuren willen aanvangen bij jullie. \r\nWe zijn met 6 personen waaronder wel 1 bob. Deze ene persoon zal wellicht minder proeven als de rest door zijn taak.\r\nDe persoon in kwestie drinkt liefst rode wijn. \r\n\r\nKunt u ons hiermee verder helpen? \r\nEn eventueel al een richtprijs meedelen? \r\n\r\nZo ja kan er dan telefonisch contact opgenomen worden om de zaken verder te regelen?\r\n\r\nAlvast bedankt \r\n\r\nDries Mattheus', '2016-06-13 18:21:32', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(420, 'Air Jordan 4', 'bqmxvjk@gmail.com', 'http://dgzzxy.c', 'Dry autumn leaves revolved in your soul.', '2016-06-17 02:43:54', 'http://www.colvenier.be/indexen/book-online.htm'),
(421, 'Jan Lens', 'janlens@telenet.be', '0477446386', 'graag offerte voor een feest met ongeveer 35 mensen, waarvan 5 kinderen op 19 november of 25 november 2016\r\nKan een diner worden opgediend in een aparte zaal?', '2016-06-19 13:30:59', 'http://www.colvenier.be/reserveer.htm'),
(422, 'Ugg Boots Clearance', 'kjevqrxm@gmail.com', 'http://www.wome', 'Thanks-a-mundo for the post.Much thanks again. Awesome.\r\n[url=http://www.womenbootsonlinesale.net]Ugg Boots Clearance[/url]\r\n <a href=\"http://www.womenbootsonlinesale.net\" title=\"Ugg Boots Clearance\">Ugg Boots Clearance</a>', '2016-06-20 07:49:40', 'http://www.colvenier.be/indexen/book-online.htm'),
(423, 'Van Steenlandt Willy', 'willy.van.steenlandt@telenet.be', '0495346121', 'Kan ik reserveren in de kleine colvenier  op 6 augustus 2016 om 17.00 uur met 4 personen? ', '2016-06-20 16:35:45', 'http://www.colvenier.be/reserveer.htm'),
(424, 'Katrien De Decker', 'dedecker.katrien@hotmail.com', '0477 99 91 65', 'Beste\r\nMijn man is jarig en ik zou hem eventueel het arrangement wijnproeven voor twee willen geven. Hoeveel kost dit ? Wordt er tijdens deze sessie ook de basisprincipes van wijnproeven toegelicht ?', '2016-06-21 21:11:04', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(425, 'Marieke', 'marieketaselaar@gmail.com', '0650407004', 'Beste,\r\n\r\nGraag zou ik wat meer informatie willen over de mogelijkheden van een wijnproeverij voor 7 personen. Hoe lang duurt de proeverij en wat zijn de kosten? Heeft u nog plek op zaterdag 16 juli aan het einde van de middag? Ik hoor graag van u. Met vriendelijke groet, Marieke Taselaar', '2016-06-22 21:29:47', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(426, 'ulbe tolner', 'utolner@email.com', '+31 6 21468197', 'Goedemiddag,\r\nKomend weekend ben ik met mijn vrouw in Antwerpen. Ik zie dat u voor 2 personen een wijnproef arrangement hebt. Kunt u mij aangeven wat de kosten hiervan zijn?\r\nMet vriendelijke dank,\r\nUlbe Tolner', '2016-06-29 17:05:25', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(427, 'Wim Staelens', 'staelenswim@yahoo.co.uk', '0487620825', 'Ik had graag een tafel voor 2 pers gereserveerd in de KLEINE COLVENIER op woe 6 juli om 12u. Kan u mij aub bevestigen indien u de reservering accepteert ? Hartelijk dank, Wim Staelens', '2016-07-03 21:50:15', 'http://www.colvenier.be/reserveer.htm'),
(428, 'Liesbeth Vercammen', 'liesbeth.vercammen@gmail.com', '0476980014', 'Beste heer, mevrouw, ik check voor alle zekerheid of er echt geen reservatie kan gemaakt worden op een maandag? Het zou gaan om een etentje voor 8 personen na een huwelijk. Ik vermoed van niet, maar vraag toch maar even. We zijn fan van Huis De Colvenier :-) Alvast dank! ', '2016-07-04 19:02:11', 'http://www.colvenier.be/reserveer.htm'),
(429, 'Rooms Claudio', 'claudio_watte@hotmail.com', '0479718875', 'wat zijn de openingsuren,prijs en hoe reserveert men voor een wijnproeverij? \r\n\r\nMvg,\r\n\r\nClaudio', '2016-07-07 02:19:40', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(430, 'anouck hoet', 'a.hoet@telenet.be', '0477292237', 'Beste, \r\n\r\nGraag had ik geweten wat het wijnarrangement kost voor 2 personen? \r\nKrijgen we ook details mee van waar we op moeten letten/proeven en dergelijke tijdens dit arrangement?  Ik zou graag mijn horizon wat willen verbreden in de wijncultuur. \r\n\r\nAlvast bedankt om hier snel op te antwoorden! \r\nMvg, \r\n\r\nAnouck Hoet ', '2016-07-07 11:54:21', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(431, 'Roeland Tordoir', 'roeland@rawberry-group.com', '0468236691', 'Beste,\r\n\r\nZou het eventueel mogelijk zijn om maandagavond een wijndegustatie te doen voor 2 personen? Daar mag ook een bordje ganda ham bij zijn!\r\n\r\nVriendelijke Groeten,\r\nRoeland Tordoir\r\n', '2016-07-08 10:44:35', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(432, 'Anne-Marie Hagenaars', 'hagenaars@HOTMAIL.COM', '0628684900', 'Beste, ik bezoek op 15 juli met mijn man antwerpen omdat wij 9 jaar samen zijn en het daar allemaal begonnen is. Heeft u op deze dag (liefst einde middag) nog plaats voor een wijndegustatie voor 2 personen. Zo ja, wat zijn de kosten?\r\n\r\nHartelijke groet,\r\nanne-marie hagenaars', '2016-07-08 15:57:45', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(433, 'wout floren', 'woutfloren@msn.com', '0477940661', 'Ik zou dit graag eens met mijn vriendin komen doen. Kan u me wat meer vertellen over mogelijk beschikbare tijden en prijzen?\r\n\r\nMet vriendelijke groet,\r\n\r\nWout Floren\r\n\r\nP.S. Gelieve niet bellen, een e-mailtje volstaat.', '2016-07-16 11:01:36', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(434, 'Wout Floren', 'woutfloren@msn.com', '0477940661', 'Dat zou dan voor 22juli rond 19.30 zijn. Zou dat lukken? (voor 2personen)\r\n\r\nMvG\r\n\r\nWout Floren', '2016-07-16 11:10:32', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(435, 'Verdonck', 'rozanneverdonck@hotmail.com', '0488/994691', 'Beste\r\n\r\nIk had graag de prijs geweten van een wijnarrangement voor twee personen. Werkt dit op basis van een inschrijving?\r\n\r\nDank alvast voor de info!\r\n\r\nRozanne', '2016-07-22 18:26:11', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(436, 'Jolanda Burgs', 'jolandaburgs@planet.nl', '0031644330959', 'Goedenavond,\r\nGraag zou ik van u een prijsindicatie ontvangen voor de wijndegustatie voor 2 personen op zaterdag 30 juli\r\nHoeveel tijd neemt de degustatie ongeveer in beslag ?\r\n\r\nDank voor uw spoedige bericht\r\n\r\nMet vriendelijke groet,\r\n\r\nJolanda Burgs\r\nGoes\r\n\r\nNederland', '2016-07-23 19:19:24', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(437, 'Inge reynders', 'ingereynders@yahoo.com', '0495 94 33 59', 'goeie morgen\r\n\r\nWat zou een proefarrangement voor 2 personen kosten? Ik zou genteresseerd zijn om dit volgende week maandag of dinsdagavond 25/7 of 26/7 te laten doorgaan.\r\n\r\nalvast bedankt voor de info. \r\nmvg, Inge', '2016-07-24 08:46:40', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(438, 'Eric Van Der Plas', 'evanderplas@scarlet.be', '0497 28 94 11', 'Beste,\r\n \r\nVeranderen jullie elke maand het menu ? Zo ja , kan je dan misschien al een tipje van de sluier lichten ?\r\n \r\nWant we zouden graag reserveren in augustus en het menu van juli is niet volledig ons ding \r\n \r\ngrts\r\n \r\nEric Van Der Plas', '2016-07-24 11:25:49', 'http://www.colvenier.be/reserveer.htm'),
(439, 'Koen Verheyen', 'koen@kontrastmusic.be', '0499321893', 'Beste,\r\n\r\nIk zou graag een wijndegustatie cadeau doen aan een goede vriend.\r\n\r\nIk had dan ook graag geweten wat dit zou kosten voor een wijnarrangement voor 2 personen. En of het mogelijk is om het \"menu\" van de wijnen aan te passen aangezien we grote fans zijn van de rode wijnen.\r\n\r\nIs deze formule ook mogelijk voor 4 personen? \r\n\r\nGroeten Koen', '2016-07-27 09:54:08', 'http://www.wijnbar-antwerpen.be/contact.htm');
INSERT INTO `question` (`question_id`, `question_name`, `question_email`, `question_gsm`, `msg`, `question_date`, `refurl`) VALUES
(440, 'Viviane Duyts', 'tante_vi@telenet.be', '0494594843', 'Beste, graag ontving ik een offerte voor een verjaardagsfeestje van Lisette De Vriendt, mijn nicht die 92 j wordt in november. Het feestje zou op 12 november moeten doorgaan, een receptie met hapje en drankje en daarna een 3-of 4 gangen menu aan tafel. Wat zijn de mogelijkheden? Aparte eetgelegenheid of gezamelijk met andere mensen??? Ik kijk uit naar uw voorstel\r\nMet vriendelijke groeten\r\nViviane Duyts', '2016-07-29 22:02:35', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=2402'),
(441, 'phyllis paridaens', 'phyllis.paridaens@gmail.com', '0485618790', 'Beste, \r\n\r\nIk heb interesse in het wijnproeven voor twee personen. Graag had ik de prijs geweten en vroeg ik me af wanneer deze activiteit georganiseerd kan worden.  \r\n\r\nAlvast bedankt. \r\nMet vriendelijke groeten, \r\nPhyllis Paridaens ', '2016-07-29 23:22:17', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(442, 'Daniele', 'commerciale@costantinivini.it', '+39 085 96 99 1', 'Dear Sir or Madam,\r\n\r\nLet me introduce you Azienda Agricola Costantini Antonio. Our company is a farm existing in Abruzzo Region since 1910 that directly produces several kinds of wine exclusively from its own wineyards. Our estate stands for about 60 hectares between the Gran Sasso Mountains and the Adriatic Sea, located in the East Coast of central Italy. We produce DOC and IGT wines of a very high quality, such as Montepulciano dAbruzzo, Cerasuolo dAbruzzo, Trebbiano dAbruzzo and Pecorino DOC.\r\nWe are also producer of Extra Virgin Olive Oil from our own olive trees.\r\nAt the moment we are looking for new importers. We are available to send a sample case of our wines, in a way you would be able to taste them and decide if they could be suitable for your market.\r\nWe wish to inform you that our wines received some of the most important Wine Awards internationally recognized. Lately we were awarded in the following competitions.\r\n\r\n- International Wine Challenge 2016, the PECORINO DOC TOP line received the SILVER medal;\r\n- International Wine & Spirits Competition 2016, the PECORINO DOC TOP line, received the SILVER medal, while Montepulciano DAbruzzo DOC COSTANTINI line, received the BRONZE medal.\r\n\r\nWe are really interested to establish a mutual profitable cooperation.\r\nLooking forward to receive your answer.\r\n\r\nKind Regards.\r\n\r\nDaniele Secone\r\nSales Executive\r\n \r\nAzienda Agricola Costantini Antonio\r\nC.da Madonna della Pace, 36\r\n65013  CITTA SANTANGELO (PE)\r\nT/F +39 085 96 99 169\r\nwww.costantinivini.it\r\n', '2016-08-02 16:51:18', 'http://www.wijnbar-antwerpen.be/contact.htm'),
(443, 'Karel Peeters', 'karel.peeters23@proximus.be', '0472-866179', 'Bevestiging van ons telefoongesprek van 2/8 : gelieve een ruimte voor ongeveer 40 personen te reserveren op zaterdag 1/10/2016, om 18.45 u. Ik kom nog bij U ter plaatse om verdere afspraken te maken.\r\nGroeten,\r\nKarel Peeters 0472-866179', '2016-08-03 10:14:18', 'http://www.colvenier.be/reserveer.htm'),
