(461, 'wilfried bracke', 'bracke.wilfried@telenet.be', '0485747535', 'Ik ben eens bij U langsgeweest en U vertelde mij, dat U op maandag gesloten bent.  Ik heb een feestje met 14  16 personen naar aanleiding van een huwelijk.  Kan U ons een menu voorstellen met aperitief, wijnen en water inbegrepen ?', '2016-10-03 21:51:33', 'http://www.colvenier.be/succes-beschikbaarheid.php?id=2612'),
(462, 'Magali Buchmann', 'magali.buchmann@monsanto.com', '03 568 54 95', 'Beste \r\n\r\nIs het mogelijk om bij u een 5-tal diners te organiseren van ongeveer 30 personen per avond op volgende vrijdagen:\r\n\r\n18/11, 25/11, 02/12, 09/12 en 16/12   \r\n\r\nDit betreft steeds een andere groep genodigden per avond. Per diner kan het aantal deelnemers lichtjes verschillen. \r\n\r\nWe hadden graag een offerte ontvangen voor een 4-gangendiner inclusief dranken tijdens/na de maaltijd aan een max. bedrag van 75 euro/persoon (all-in). \r\n\r\nIs het mogelijk om 5 verschillende menus (elke vrijdag een ander menu) samen te stellen met een divers aanbod (dus geen menu met n centrale groente) en een alternatief menu samen te stellen voor mogelijke vegetarirs. Aantal vegetarirs of speciale diten zouden dan voor het evenement tijdig aan u worden meegedeeld, eveneens het aantal aanwezigen. Het menu mag eindigen met koffie/thee met versnaperingen.\r\n\r\nQua timing wordt er geopteerd om rond 19.00u te beginnen, maar na de maaltijd wil men graag nog de mogelijkheid hebben om na te praten met een borrel. Kan er eventueel een drankenforfait voorzien worden tot middernacht, die per begonnen uur verlengd kan worden? Het event eindigt max. om 2 uur s nachts.\r\n\r\nKan er na elke diner ook een afzonderlijke factuur opgemaakt worden? \r\n\r\nKunnen zij in een afzonderlijke ruimte zitten gedurende de avond? \r\n\r\nAlvast bedankt!\r\n\r\nMet vriendelijke groeten,\r\n\r\nMagali Buchmann\r\nMonsanto Europe NV (Antwerpen)', '2016-10-05 16:31:21', 'http://www.colvenier.be/reserveer.htm'),
(463, 'Huub van der Pluijm', 'vdpluijm@ziggo.nl', '0031-654325568', 'Vraag, zijn jullie 31 december a.s. geopend en is er nog een appartement vrij 30-31 december 2016 (2 overnachtingen) Ik verneem graag de mogelijkheden.', '2016-10-11 17:52:05', 'http://www.colvenier.be/reserveer.htm'),
