(502, 'Geert Wennekes', 'geertwennekes@hotmail.com', '31-6-29055650', 'Beste, ik wilde zojuist telefonisch mijn komst van as zaterdag om 19.00 met twee personen herbevestigen, zoals telefonisch met u maanden geleden besproken. Echter ik krijg een melding dat het telefoonnummer zoals op uw site vermeld  niet in gebruik is.Wilt u voor de zekerheid ook naar mij herbevestigen? Bij voorbaat dank, vriendelijke groeten  , Geert Wennekes', '2016-12-27 12:03:40', 'http://www.colvenier.be/reserveer.htm'),
(503, 'Dirk', 'Dirk.adriaenssen@total.com', '+32 475 94 20 8', 'wij zouden graag over een conferentie ruimtevoorzien van een BEAMER beschikken voor 5 personen.  Wij plannen om rond 9h00 te starten, middag eten rond 12h30 eindigen rond 17h30.\r\nIs dit voor u OK ?', '2016-12-30 13:28:00', 'http://www.colvenier.be/reserveer.htm'),
(504, 'R.Van Overstraeten', 'r.overstraeten@hotmail.com', 'tel.053/665506 ', 'openingsdagen in januari ?\r\ngraag een mailtje daarover.', '2017-01-02 15:49:13', 'http://www.colvenier.be/reserveer.htm'),
(505, 'Canada Goose Online Outlet Store', 'gzgxqvimeyl@gmail.com', 'http://www.cana', 'very good publish, i actually love this website, keep on it', '2017-01-09 18:52:29', 'http://www.colvenier.be/indexen/book-online.htm'),
(506, 'Fleur Talloen', 'fleurtalloen@hotmail.com', '0479297791', 'Beste,\r\nOp 22 april organiseer ik een vrijgezellen, we zijn met 10 personen in totaal. Ik wou gewoon even checken of het eventueel ook mogelijk zou zijn om enkel te wijnkelder te mogen benuttigen voor de huisaperitief, of een glas cava, met hapjes of tapas? Dus het eten/menu in het restaurant zelf zouden we normaal niet doen. Volledig verstaanbaar uiteraard indien dit niet mogelijk zou zijn, maar wou het toch even navragen want vind jullie wijnkelder echt top! \r\nAlvast bedankt.\r\n\r\nFleur', '2017-01-22 18:02:58', 'http://www.colvenier.be/reserveer.htm'),
(507, 'Lie Huyben', 'lie.huyben@ap.be', '0470 21 03 10', 'Wij willen een diner organiseren op woensdag 22 februari 2017 om 18 uur.\r\nDeelnemers max. 25 personen  graag aparte ruimte.\r\nKunt u ons een voorstel maken voor een drie- en  viergangenmenu incl. aperitief, aangepaste wijnen, water en afsluitende koffie?\r\nAarzel niet mij te contacteren indien u nog bijkomende informatie nodig mocht hebben.\r\n\r\nMet dank voor een reactie en vriendelijke groet\r\n\r\n', '2017-01-26 15:24:41', 'http://www.colvenier.be/reserveer.htm');
